INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (1, N'https://www.tvmaze.com/shows/1/under-the-dome', N'Under the Dome', N'Scripted', N'English', N'Drama, Science-Fiction, Thriller', N'Ended', 60, 60, N'2013-06-24', N'2015-09-10', N'http://www.cbs.com/shows/under-the-dome/', 0, 98, N'', N'<p><b>Under the Dome</b> is the story of a small town that is suddenly and inexplicably sealed off from the rest of the world by an enormous transparent dome. The town''s inhabitants must deal with surviving the post-apocalyptic conditions while searching for answers about the dome, where it came from and if and when it will go away.</p>', 1631010933, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/81/202627.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/81/202627.jpg', N'', N'US', N'United States', N'CBS', N'', N'', N'', 6.5, N'Thursday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (2, N'https://www.tvmaze.com/shows/2/person-of-interest', N'Person of Interest', N'Scripted', N'English', N'Action, Crime, Science-Fiction', N'Ended', 60, 60, N'2011-09-22', N'2016-06-21', N'http://www.cbs.com/shows/person_of_interest/', 0, 98, N'', N'<p>You are being watched. The government has a secret system, a machine that spies on you every hour of every day. I know because I built it. I designed the Machine to detect acts of terror but it sees everything. Violent crimes involving ordinary people. People like you. Crimes the government considered "irrelevant". They wouldn''t act so I decided I would. But I needed a partner. Someone with the skills to intervene. Hunted by the authorities, we work in secret. You''ll never find us. But victim or perpetrator, if your number is up, we''ll find you.</p>', 1631565378, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/163/407679.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/163/407679.jpg', N'', N'US', N'United States', N'CBS', N'', N'', N'', 8.9, N'Tuesday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (3, N'https://www.tvmaze.com/shows/3/bitten', N'Bitten', N'Scripted', N'English', N'Drama, Horror, Romance', N'Ended', 60, 60, N'2014-01-11', N'2016-04-15', N'http://bitten.space.ca/', 0, 96, N'', N'<p>Based on the critically acclaimed series of novels from Kelley Armstrong. Set in Toronto and upper New York State, <b>Bitten</b> follows the adventures of 28-year-old Elena Michaels, the world''s only female werewolf. An orphan, Elena thought she finally found her "happily ever after" with her new love Clayton, until her life changed forever. With one small bite, the normal life she craved was taken away and she was left to survive life with the Pack.</p>', 1638776591, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/15.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/15.jpg', N'', N'CA', N'Canada', N'CTV Sci-Fi Channel', N'', N'', N'', 7.6, N'Friday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (4, N'https://www.tvmaze.com/shows/4/arrow', N'Arrow', N'Scripted', N'English', N'Drama, Action, Science-Fiction', N'Ended', 60, 60, N'2012-10-10', N'2020-01-28', N'http://www.cwtv.com/shows/arrow', 0, 98, N'', N'<p>After a violent shipwreck, billionaire playboy Oliver Queen was missing and presumed dead for five years before being discovered alive on a remote island in the Pacific. He returned home to Starling City, welcomed by his devoted mother Moira, beloved sister Thea and former flame Laurel Lance. With the aid of his trusted chauffeur/bodyguard John Diggle, the computer-hacking skills of Felicity Smoak and the occasional, reluctant assistance of former police detective, now beat cop, Quentin Lance, Oliver has been waging a one-man war on crime.</p>', 1644209365, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/213/534017.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/213/534017.jpg', N'', N'US', N'United States', N'The CW', N'https://www.cwtv.com/', N'', N'', 7.4, N'Tuesday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (5, N'https://www.tvmaze.com/shows/5/true-detective', N'True Detective', N'Scripted', N'English', N'Drama, Crime, Thriller', N'Running', 60, 62, N'2014-01-12', N'', N'http://www.hbo.com/true-detective', 0, 99, N'', N'<p>Touch darkness and darkness touches you back. <b>True Detective</b> centers on troubled cops and the investigations that drive them to the edge. Each season features a new cast and a new case.</p>', 1643527614, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/178/445621.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/178/445621.jpg', N'', N'US', N'United States', N'HBO', N'https://www.hbo.com/', N'', N'', 8.2, N'Sunday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (6, N'https://www.tvmaze.com/shows/6/the-100', N'The 100', N'Scripted', N'English', N'Action, Adventure, Science-Fiction', N'Ended', 60, 60, N'2014-03-19', N'2020-09-30', N'http://www.cwtv.com/shows/the-100/', 0, 98, N'', N'<p>Ninety-seven years ago, nuclear Armageddon decimated planet Earth, destroying civilization. The only survivors were the 400 inhabitants of 12 international space stations that were in orbit at the time. Three generations have been born in space, the survivors now number 4,000, and resources are running out on their dying "Ark" - the 12 stations now linked together and repurposed to keep the survivors alive. Draconian measures including capital punishment and population control are the order of the day, as the leaders of the Ark take ruthless steps to ensure their future, including secretly exiling a group of 100 juvenile prisoners to the Earth''s surface to test whether it''s habitable.</p>', 1601577688, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/257/642675.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/257/642675.jpg', N'', N'US', N'United States', N'The CW', N'', N'', N'', 7.8, N'Wednesday', N'20:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (7, N'https://www.tvmaze.com/shows/7/homeland', N'Homeland', N'Scripted', N'English', N'Drama, Thriller, Espionage', N'Ended', 60, 60, N'2011-10-02', N'2020-04-26', N'http://www.sho.com/sho/homeland/home', 0, 98, N'', N'<p>The winner of 6 Emmy Awards including Outstanding Drama Series, <b>Homeland</b> is an edge-of-your-seat sensation. Marine Sergeant Nicholas Brody is both a decorated hero and a serious threat. CIA officer Carrie Mathison is tops in her field despite being bipolar. The delicate dance these two complex characters perform, built on lies, suspicion, and desire, is at the heart of this gripping, emotional thriller in which nothing short of the fate of our nation is at stake.</p>', 1590059677, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/230/575652.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/230/575652.jpg', N'', N'US', N'United States', N'Showtime', N'', N'', N'', 8.2, N'Sunday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (8, N'https://www.tvmaze.com/shows/8/glee', N'Glee', N'Scripted', N'English', N'Drama, Music, Romance', N'Ended', 60, 60, N'2009-05-19', N'2015-03-20', N'http://www.fox.com/glee', 0, 94, N'', N'<p><b>Glee </b>is a musical comedy about a group of ambitious and talented young adults in search of strength, acceptance and, ultimately, their voice.</p>', 1636002540, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/73.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/73.jpg', N'', N'US', N'United States', N'FOX', N'', N'', N'', 6.7, N'Friday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (9, N'https://www.tvmaze.com/shows/9/revenge', N'Revenge', N'Scripted', N'English', N'Drama, Thriller, Mystery', N'Ended', 60, 60, N'2011-09-21', N'2015-05-10', N'', 0, 91, N'', N'<p>This is not a story about forgiveness; <b>Revenge</b> is a show about retribution. Meet Emily Thorne, the newest resident of The Hamptons. When she was a little girl (and known as Amanda Clarke) her father, David Clarke, was framed for a horrific crime and subsequently sent to prison. While serving his time, the conspirators plotted and murdered David in order to prevent the truth from coming out. Emily is now back with a new identity and ready to take vengeance on the people that murdered her father and stole her childhood.</p>', 1577712742, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/82/206879.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/82/206879.jpg', N'', N'US', N'United States', N'ABC', N'', N'', N'', 7.7, N'Sunday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (10, N'https://www.tvmaze.com/shows/10/grimm', N'Grimm', N'Scripted', N'English', N'Drama, Crime, Supernatural', N'Ended', 60, 60, N'2011-10-28', N'2017-03-31', N'http://www.nbc.com/grimm', 0, 97, N'', N'<p><b>Grimm </b>is a drama series inspired by the classic Grimm Brothers'' Fairy Tales. After Portland homicide detective Nick Burkhardt discovers he''s descended from an elite line of criminal profilers known as "Grimms", he increasingly finds his responsibilities as a detective at odds with his new responsibilities as a Grimm.</p>', 1643090024, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/69/174906.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/69/174906.jpg', N'', N'US', N'United States', N'NBC', N'https://www.nbc.com/', N'', N'', 8.5, N'Friday', N'20:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (11, N'https://www.tvmaze.com/shows/11/gotham', N'Gotham', N'Scripted', N'English', N'Drama, Action, Crime', N'Ended', 60, 60, N'2014-09-22', N'2019-04-25', N'http://www.fox.com/gotham', 0, 96, N'', N'<p>The good. The evil. The beginning.</p><p>Everyone knows the name Commissioner Gordon. He is one of the crime world''s greatest foes, a man whose reputation is synonymous with law and order. But what is known of Gordon''s story and his rise from rookie detective to Police Commissioner? What did it take to navigate the multiple layers of corruption that secretly ruled Gotham City, the spawning ground of the world''s most iconic villains? And what circumstances created them – the larger-than-life personas who would become Catwoman, The Penguin, The Riddler, Two-Face and The Joker?</p><p><b>Gotham </b>is an origin story of the great DC Comics Super-Villains and vigilantes, revealing an entirely new chapter that has never been told. It follows one cop''s rise through a dangerously corrupt city teetering between good and evil, and chronicles the birth of one of the most popular super heroes of our time.</p>', 1629785296, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/189/474715.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/189/474715.jpg', N'', N'US', N'United States', N'FOX', N'', N'', N'', 7.7, N'Thursday', N'20:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (12, N'https://www.tvmaze.com/shows/12/lost-girl', N'Lost Girl', N'Scripted', N'English', N'Drama, Fantasy, Horror', N'Ended', 60, 60, N'2010-09-12', N'2015-10-25', N'http://www.showcase.ca/lostgirl', 0, 89, N'', N'<p><b>Lost Girl</b> follows supernatural seductress Bo, a Succubus who feeds on the sexual energy of humans. Growing up with human parents, Bo had no reason to believe she was anything other than the girl next door — until she drained her boyfriend to death in their first sexual encounter. Now she has hit the road alone and afraid. <br /> She discovers she is one of the Fae, creatures of legend and folklore, who pass as humans while feeding off them secretly and in different ways, as they have for millennia. Relieved yet horrified to find out that she is not alone, Bo decides to take the middle path between the humans and the Fae while embarking on a personal mission to unlock the secrets of her origin.</p><p>With the help of her human sidekick, Kenzi, and Dyson, a sexy police detective, Bo takes on a challenge every week helping a Fae or human client who comes to her to solve a mystery, or to right a wrong.</p>', 1637172832, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/137.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/137.jpg', N'', N'CA', N'Canada', N'Showcase', N'', N'', N'', 8.1, N'Sunday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (13, N'https://www.tvmaze.com/shows/13/the-flash', N'The Flash', N'Scripted', N'English', N'Drama, Action, Science-Fiction', N'Running', 60, 60, N'2014-10-07', N'', N'http://www.cwtv.com/shows/the-flash/', 0, 100, N'', N'<p>After a particle accelerator causes a freak storm, CSI Investigator Barry Allen is struck by lightning and falls into a coma. Months later he awakens with the power of super speed, granting him the ability to move through Central City like an unseen guardian angel. Though initially excited by his newfound powers, Barry is shocked to discover he is not the only "meta-human" who was created in the wake of the accelerator explosion -- and not everyone is using their new powers for good. Barry partners with S.T.A.R. Labs and dedicates his life to protect the innocent. For now, only a few close friends and associates know that Barry is literally the fastest man alive, but it won''t be long before the world learns what Barry Allen has become...The Flash!</p>', 1639589749, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/383/957712.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/383/957712.jpg', N'', N'US', N'United States', N'The CW', N'', N'', N'', 7.8, N'Tuesday', N'20:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (14, N'https://www.tvmaze.com/shows/14/continuum', N'Continuum', N'Scripted', N'English', N'Drama, Crime, Science-Fiction', N'Ended', 60, 60, N'2012-05-27', N'2015-10-09', N'http://www.showcase.ca/Continuum', 0, 95, N'', N'<p><b>Continuum </b>is a one-hour police drama centered on Kiera Cameron, a regular cop from 65 years in the future who finds herself trapped in present day Vancouver. She is alone, a stranger in a strange land, and has eight of the most ruthless criminals from the future, known as Liber8, loose in the city.</p><p>Lucky for Kiera, through the use of her CMR (cellular memory recall), a futuristic liquid chip technology implanted in her brain, she connects with Alec Sadler, a seventeen-year-old tech genius. When Kiera calls and Alec answers, a very unique partnership begins.</p><p>Kiera''s first desire is to get "home." But until she figures out a way to do that, she must survive in our time period and use all the resources available to her to track and capture the terrorists before they alter history enough to change the course of the future. After all, what''s the point of going back if the future isn''t the one you left?</p>', 1573153509, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/184.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/184.jpg', N'', N'CA', N'Canada', N'Showcase', N'', N'', N'', 8.2, N'Sunday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (15, N'https://www.tvmaze.com/shows/15/constantine', N'Constantine', N'Scripted', N'English', N'Drama, Action, Horror', N'Ended', 60, 60, N'2014-10-24', N'2015-02-13', N'https://www.nbc.com/constantine', 0, 95, N'', N'<p>Based on the wildly popular comic book series "Hellblazer" from DC Comics, seasoned demon hunter and master of the occult John Constantine is armed with a ferocious knowledge of the dark arts and a wickedly naughty wit. He fights the good fight - or at least he did. With his soul already damned to hell, he''s decided to abandon his campaign against evil until a series of events thrusts him back into the fray, and he''ll do whatever it takes to protect the innocent. With the balance of good and evil on the line‎, <b>Constantine </b>will use his skills to travel the country, find the supernatural terrors that threaten our world and send them back where they belong. After that, who knows... maybe there''s hope for him and his soul after all.</p>', 1628512022, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/154.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/154.jpg', N'', N'US', N'United States', N'NBC', N'', N'', N'', 7.5, N'Friday', N'20:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (16, N'https://www.tvmaze.com/shows/16/penny-dreadful', N'Penny Dreadful', N'Scripted', N'English', N'Horror, Thriller, Supernatural', N'Ended', 60, 60, N'2014-05-11', N'2016-06-19', N'http://www.sho.com/penny-dreadful', 0, 95, N'', N'<p>Some of literature''s most terrifying characters, including Dr. Frankenstein and his monster, Dorian Gray, and iconic figures from the novel Dracula are lurking in the darkest corners of Victorian London. They are joined by a core of original characters in a complex, frightening new narrative. <b>Penny Dreadful </b>is a psychological thriller filled with dark mystery and suspense, where personal demons from the past can be stronger than vampires, evil spirits and immortal beasts.</p>', 1618777715, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/48/122260.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/48/122260.jpg', N'', N'US', N'United States', N'Showtime', N'', N'', N'', 8.3, N'Sunday', N'21:00', 0, N'', N'', N'')
