INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (20, N'https://www.tvmaze.com/shows/20/the-strain', N'The Strain', N'Scripted', N'English', N'Drama, Horror, Thriller', N'Ended', 60, 61, N'2014-07-13', N'2017-09-17', N'http://www.fxnetworks.com/thestrain', 0, 88, N'', N'<p><b>The Strain</b> is a high-concept thriller that tells the story of Dr. Ephraim Goodweather, the head of the Center for Disease Control Canary Team in New York City. He and his team are called upon to investigate a mysterious viral outbreak with hallmarks of an ancient and evil strain of vampirism. As the strain spreads, Goodweather, his team, and an assembly of everyday New Yorkers wage war for the fate of humanity itself.</p>', 1642363929, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/70/175363.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/70/175363.jpg', N'', N'US', N'United States', N'FX', N'', N'', N'', 7.5, N'Sunday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (21, N'https://www.tvmaze.com/shows/21/the-last-ship', N'The Last Ship', N'Scripted', N'English', N'Drama, Action, Thriller', N'Ended', 60, 60, N'2014-06-22', N'2018-11-11', N'http://www.tntdrama.com/shows/the-last-ship', 0, 93, N'', N'<p>Their mission is simple: Find a cure. Stop the virus. Save the world. When a global pandemic wipes out eighty percent of the planet''s population, the crew of a lone and unaffected Navy destroyer, the USS Nathan James, must find a way to pull humanity from the brink of extinction.</p>', 1637411031, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/164/412464.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/164/412464.jpg', N'', N'US', N'United States', N'TNT', N'', N'', N'', 7.6, N'Sunday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (22, N'https://www.tvmaze.com/shows/22/true-blood', N'True Blood', N'Scripted', N'English', N'Drama, Romance, Supernatural', N'Ended', 60, 60, N'2008-09-07', N'2014-08-24', N'http://www.hbo.com/true-blood', 0, 98, N'', N'<p><b>True Blood </b>is a horror/drama based on a series of novels called <i>The Southern American Vampires Mysteries</i>. It focuses on Sookie Stackhouse and her various encounters with vampires and other supernatural beings. The show is centred in the small town of Bon Temps in Louisiana. The show focuses heavily on the co-existence of humans with vampires. The show also touches on several other controversial issues involving equal rights, violence, discrimination and religion.</p>', 1643530260, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/236/590987.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/236/590987.jpg', N'', N'US', N'United States', N'HBO', N'https://www.hbo.com/', N'', N'', 7.9, N'Sunday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (23, N'https://www.tvmaze.com/shows/23/once-upon-a-time-in-wonderland', N'Once Upon a Time in Wonderland', N'Scripted', N'English', N'Drama, Adventure, Fantasy', N'Ended', 60, 60, N'2013-10-10', N'2014-04-03', N'', 0, 88, N'', N'<p>In Victorian England, the young and beautiful Alice tells a tale of a strange new land that exists on the other side of a rabbit hole. An invisible cat, a hookah smoking caterpillar and playing-cards that talk are just some of the fantastic things she''s seen during this impossible adventure. Surely this troubled girl must be insane, and her doctors aim to cure her with a treatment that will make her forget everything. Alice seems ready to put it all behind her, especially the painful memory of the genie she fell in love with and lost forever -- the handsome and mysterious Cyrus . But deep down Alice knows this world is real, and just in the nick of time the sardonic Knave of Hearts and the irrepressible White Rabbit arrive to save her from a doomed fate. Together the trio will take a tumble down the rabbit hole to this Wonderland where nothing is impossible.</p>', 1606705379, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/73/183661.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/73/183661.jpg', N'', N'US', N'United States', N'ABC', N'', N'', N'', 6.8, N'Thursday', N'20:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (24, N'https://www.tvmaze.com/shows/24/hawaii-five-0', N'Hawaii Five-0', N'Scripted', N'English', N'Drama, Action, Crime', N'Ended', 60, 60, N'2010-09-20', N'2020-04-03', N'http://www.cbs.com/shows/hawaii_five_0/', 0, 97, N'', N'<p><b>Hawaii Five-0</b> is a contemporary take on the classic series about a new elite federalized task force whose mission is to wipe out the crime that washes up on the Islands'' sun-drenched beaches. Detective Steve McGarrett, a decorated Naval officer-turned-cop, returned to Oahu to investigate his father''s murder and stayed after Hawaii''s former governor persuaded him to head up the new team: his rules, no red tape and full blanket authority to hunt down the biggest "game" in town. Joining McGarrett is Detective Danny "Danno" Williams, a relocated ex-New Jersey cop - a working man in paradise who prefers skyscrapers to the coastline - but who''s committed to keeping the Islands safe for his young daughter; Chin Ho Kelly, an ex-Honolulu police detective and former protégé of McGarrett''s father who was wrongly accused of corruption; Dr. Max Bergman, the quirky coroner; Chin''s cousin, Kono Kalakaua, a beautiful and fearless native; and Captain Lou Grover, who formerly headed Hawaii''s SWAT unit. Joining them is Jerry Ortega, a former classmate of Chin''s and the Island''s local conspiracy theorist. The state''s brash FIVE-0 unit, who may spar and jest among themselves, remain determined to eliminate the seedy elements from the 50th state.</p>', 1637982716, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/213/532575.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/213/532575.jpg', N'', N'US', N'United States', N'CBS', N'', N'', N'', 7.6, N'Friday', N'21:00', 0, N'', N'', N'')
