INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (37, N'https://www.tvmaze.com/shows/37/intruders', N'Intruders', N'Scripted', N'English', N'Drama, Fantasy, Thriller', N'Ended', 60, 60, N'2014-08-23', N'2014-10-11', N'http://www.bbc.co.uk/programmes/b04nf78f', 0, 93, N'', N'<p>A contemporary, chilling, paranormal tale set in the moody Pacific Northwest, the series spins a fascinating and complex web of drama. As strange, apparently unrelated events start happening, multiple story-lines - a missing wife, an assassin covering his crimes, a child on the run - begin to intertwine to reveal a conspiracy that will forever change our understanding of human nature.</p>', 1574217527, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/126/316698.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/126/316698.jpg', N'', N'US', N'United States', N'BBC America', N'', N'', N'', 6.9, N'Saturday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (38, N'https://www.tvmaze.com/shows/38/z-nation', N'Z Nation', N'Scripted', N'English', N'Action, Horror, Science-Fiction', N'Ended', 60, 61, N'2014-09-12', N'2018-12-28', N'http://www.syfy.com/znation', 0, 97, N'', N'<p><b>Z Nation</b> starts three years after the zombie virus has gutted the country, a team of everyday heroes must transport the only known survivor of the plague from New York to California, where the last functioning viral lab waits for his blood. Although the antibodies he carries are the world''s last, best hope for a vaccine, he hides a dark secret that threatens them all. With humankind''s survival at stake, the ragtag band embarks on a journey of survival across three thousand miles of rusted-out post-apocalyptic America.</p>', 1631077982, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/170/426759.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/170/426759.jpg', N'', N'US', N'United States', N'Syfy', N'', N'', N'', 7.3, N'Friday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (39, N'https://www.tvmaze.com/shows/39/resurrection', N'Resurrection', N'Scripted', N'English', N'Drama, Science-Fiction, Mystery', N'Ended', 60, 60, N'2014-03-09', N'2015-01-25', N'', 0, 52, N'', N'<p>The people of Arcadia, Missouri are forever changed when their deceased loved ones suddenly start to reappear. An 8-year-old American boy wakes up alone in a rice paddy in a rural Chinese province with no idea how he got there. Details start to emerge when the boy, who calls himself Jacob, recalls that his hometown is Arcadia, and an Immigration agent, J. Martin Bellamy, takes him there. The home he claims as his own is occupied by a 60-year-old couple, Henry and Lucille Langston, who lost their son, Jacob, more than 30 years ago. While they look different, young Jacob recognizes them as his parents. Lucille is overjoyed at the seeming miracle of her son''s reappearance. Henry is reluctant to accept that Jacob is back. Those closest to the family want answers, including Sheriff Fred Langston, whose wife Barbara drowned 30 years ago while trying to save Jacob, and Fred''s daughter, Maggie, a local doctor. Pastor Tom Hale seeks a spiritual reason for what''s happening in his community. When things take an even more shocking turn, Maggie''s life-long friend, Elaine Richards, finds herself drawn into Arcadia''s growing mystery. Bellamy, an outsider in the town, joins forces with Maggie to figure out why the unexplainable is happening in Arcadia. As their investigation plays out, Maggie learns some unsettling truths about her own past. Will they be able to solve the mystery of Arcadia before the rest of the world catches on to events there? And will they be able to protect Jacob from forces beyond their control?</p>', 1577713566, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/350.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/350.jpg', N'', N'US', N'United States', N'ABC', N'', N'', N'', 7.3, N'Sunday', N'21:00', 0, N'', N'', N'')
