INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (44, N'https://www.tvmaze.com/shows/44/scorpion', N'Scorpion', N'Scripted', N'English', N'Drama, Action, Thriller', N'Ended', 60, 60, N'2014-09-22', N'2018-04-16', N'http://www.cbs.com/shows/scorpion/', 0, 95, N'', N'<p><b>Scorpion</b>, inspired by a true story, is a high-octane drama about eccentric genius Walter O''Brien and his team of brilliant misfits who comprise the last line of defense against complex, high-tech threats of the modern age. As Homeland Security''s new think tank, O''Brien''s "Scorpion" team includes Toby Curtis an expert behaviorist who can read anyone; Happy Quinn, a mechanical prodigy; and Sylvester Dodd, a statistics guru. Pooling their extensive technological knowledge to solve mind-boggling predicaments amazes federal agent Cabe Gallo, who shares a harrowing history with O''Brien. However, while this socially awkward group is comfortable with each other''s humor and quirks, life outside their circle confounds them, so they rely on Paige Dineen, who has a young, gifted son, to translate the world for them. At last, these nerdy masterminds have found the perfect job: a place where they can apply their exceptional brainpower to solve the nation''s crises, while also helping each other learn how to fit in.</p>', 1640271384, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/128/322484.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/128/322484.jpg', N'', N'US', N'United States', N'CBS', N'', N'', N'', 7.3, N'Monday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (45, N'https://www.tvmaze.com/shows/45/ncis-new-orleans', N'NCIS: New Orleans', N'Scripted', N'English', N'Drama, Crime', N'Ended', 60, 60, N'2014-09-23', N'2021-05-23', N'http://www.cbs.com/shows/ncis-new-orleans/', 0, 97, N'', N'<p><b>NCIS: New Orleans </b>is a drama about the local field office that investigates criminal cases involving military personnel in The Big Easy, a city known for its music, entertainment and decadence. Leading the team is Special Agent Dwayne Pride, a.k.a. "King," a native of New Orleans who is driven by his need to do what is right. Working with Pride is Special Agent Christopher LaSalle, who plays hard but works harder and former ATF agent Sonja Percy, who is still adjusting to the team after years of solo undercover assignments. Supporting them is coroner Dr. Loretta Wade, who is as eccentric as she is smart; her brilliant, quirky Forensic Scientist, Sebastian Lund; and Investigative Computer Specialist Patton Plame, an animated and talented hacker. New to the team is Special Agent Tammy Gregorio, a tough, acerbic FBI agent with a mysterious past in New Orleans, who is sent from D.C. to investigate the NCIS team, but also work with Pride when high-risk cases threaten the city. This colorful city that harbors a dark side is a magnet for service personnel on leave, and when overindulgence is followed by trouble, Pride''s team is at its best</p>', 1643797115, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/280/701985.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/280/701985.jpg', N'', N'US', N'United States', N'CBS', N'https://www.cbs.com/', N'', N'', 7.7, N'Sunday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (46, N'https://www.tvmaze.com/shows/46/forever', N'Forever', N'Scripted', N'English', N'Drama, Crime, Supernatural', N'Ended', 60, 60, N'2014-09-22', N'2015-05-05', N'http://abc.go.com/shows/forever', 0, 90, N'', N'<p>Doctor Henry Morgan, New York City''s star medical examiner, has a secret. He doesn''t just study the dead to solve criminal cases, he does it to solve the mystery that has eluded him for 200 years - the answer to his own inexplicable immortality. This long life has given Henry remarkable observation skills which impresses his new partner, Detective Jo Martinez. Each week, a new case and their budding friendship will reveal layers of Henry''s long and colorful past. Only his best friend and confidant, Abe knows Henry''s secret.</p>', 1637216705, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/383.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/383.jpg', N'', N'US', N'United States', N'ABC', N'', N'', N'', 8.3, N'Monday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (47, N'https://www.tvmaze.com/shows/47/witches-of-east-end', N'Witches of East End', N'Scripted', N'English', N'Drama, Fantasy, Romance', N'Ended', 60, 60, N'2013-10-06', N'2014-10-05', N'', 0, 92, N'', N'<p>Based on Melissa de la Cruz''s best-selling novel, <b>Witches of East End</b> centers on the mysterious Beauchamp family who live in the secluded seaside town of East End. Free-spirited artist Joanna Beauchamp is the mother of wild-child bartender Freya and shy librarian Ingrid, who are both gifted -- and cursed -- with a magic birthright, of which they are unaware. Freya notices bizarre occurrences in her life when she inexplicably finds herself drawn to the troubled brother of her wealthy fiance. But it isn''t until Joanna''s estranged sister appears with a warning that could change the family''s fate that the matriarch must reveal to her daughters that they are immortal witches with untapped powers, a revelation that turns their small-town life upside down.</p>', 1607931740, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/392.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/392.jpg', N'', N'US', N'United States', N'Lifetime', N'', N'', N'', 7.7, N'Sunday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (48, N'https://www.tvmaze.com/shows/48/madam-secretary', N'Madam Secretary', N'Scripted', N'English', N'Drama', N'Ended', 60, 60, N'2014-09-21', N'2019-12-08', N'http://www.cbs.com/shows/madam-secretary/', 0, 93, N'', N'<p><b>Madam Secretary</b> follows Elizabeth McCord, the shrewd, determined, newly appointed Secretary of State who drives international diplomacy, battles office politics and circumvents protocol as she negotiates global and domestic issues, both at the White House and at home. A college professor and a brilliant former CIA analyst who left for ethical reasons, Elizabeth returns to public life at the request of the President following the suspicious death of her predecessor. The President values her apolitical leanings, her deep knowledge of the Middle East, her flair for languages and her ability to not just think outside the box, but to not even acknowledge there is a box.</p>', 1613795545, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/214/536175.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/214/536175.jpg', N'', N'US', N'United States', N'CBS', N'', N'', N'', 7.8, N'Sunday', N'22:00', 0, N'', N'', N'')
