INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (50, N'https://www.tvmaze.com/shows/50/the-lottery', N'The Lottery', N'Scripted', N'English', N'Drama, Science-Fiction, Thriller', N'Ended', 60, 60, N'2014-07-20', N'2014-09-28', N'', 0, 48, N'', N'<p>Set within a dystopian future driven by a global fertility crisis, <b>The Lottery </b>reveals a world staring down the barrel of impending extinction as women have mysteriously stopped bearing children. After years of research, Dr. Alison Lennon and her team remarkably fertilize 100 embryos. However, her victory is short-lived when the Director of the U.S. Fertility Commission, Darius Hayes, takes government control of the lab and informs the President of the monumental scientific breakthrough. To determine which women will carry the prized embryos to term, Chief of Staff Vanessa Keller convinces the President to hold a national lottery and a battle over the control of the 100 embryos begins.</p>', 1617627234, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/146/366444.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/146/366444.jpg', N'', N'US', N'United States', N'Lifetime', N'', N'', N'', 6.5, N'Sunday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (51, N'https://www.tvmaze.com/shows/51/the-knick', N'The Knick', N'Scripted', N'English', N'Drama, Medical', N'Ended', 60, 60, N'2014-08-08', N'2015-12-18', N'http://www.cinemax.com/the-knick/', 0, 91, N'', N'<p>New York City, 1900: The Knickerbocker Hospital is home to groundbreaking surgeons, nurses and staff who push the boundaries of medicine in a time of astonishingly high mortality rates and zero antibiotics. The newly appointed leader of the surgery staff is the brilliant, arrogant renegade Dr. John Thackery, whose addiction to cocaine and opium is trumped only by his ambition for medical discovery and renown among his peers. Into the all-white staff and patient hospital comes the equally gifted Harvard graduate Dr. Algernon Edwards, who must fight for respect while trying to navigate the racially charged city. Trying to maintain its reputation for quality care while realizing a profit, the Knickerbocker makes an effort to attract wealthy clientele, while literally struggling to keep the lights on.</p>', 1622293380, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/417.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/417.jpg', N'', N'US', N'United States', N'Cinemax', N'', N'', N'', 8.5, N'Friday', N'22:00', 0, N'', N'', N'')
