INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (53, N'https://www.tvmaze.com/shows/53/nashville', N'Nashville', N'Scripted', N'English', N'Drama, Music, Romance', N'Ended', 60, 60, N'2012-10-10', N'2018-07-26', N'http://www.cmt.com/shows/nashville/', 0, 95, N'', N'<p><b>Nashville</b> is set against the backdrop of the city''s music scene and follows Rayna Jaymes and Juliette Barnes. Both women face personal and professional challenges as they navigate their paths as artists and individuals. Surrounding them, and often complicating their lives, are their family, friends and, in some cases, lovers, as well as the up-and-coming performers and songwriters trying to get ahead in the business. Music City can mean so many things to different people. In Nashville, musicians and songwriters are at the heart of the storm driven by their own ambitions. Some are fueled by their creativity and passion for fame. Others struggle to cope with the pressures of success and are doing everything in their power to stay on top.</p>', 1640930577, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/89/224913.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/89/224913.jpg', N'', N'US', N'United States', N'CMT', N'', N'', N'', 7.5, N'Thursday', N'21:00', 0, N'', N'', N'')
