INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (55, N'https://www.tvmaze.com/shows/55/red-band-society', N'Red Band Society', N'Scripted', N'English', N'Drama, Comedy', N'Ended', 60, 60, N'2014-09-17', N'2015-02-07', N'https://web.archive.org/web/20170615064321/http://www.fox.com/red-band-society', 0, 48, N'', N'<p>What if a hospital was your high school, boarding school and summer camp rolled into one? What if it was the place where you fell in love for the first time and made friendships that lasted a lifetime? And what if it was all weirdly hilarious and the most fun you ever had in your entire life? This is the world of <b>Red Band Society</b>.</p>', 1574895876, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/441.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/441.jpg', N'', N'US', N'United States', N'FOX', N'', N'', N'', 7.7, N'Wednesday', N'21:00', 0, N'', N'', N'')
