INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (60, N'https://www.tvmaze.com/shows/60/ncis', N'NCIS', N'Scripted', N'English', N'Drama, Action, Crime', N'Running', 60, 60, N'2003-09-23', N'', N'http://www.cbs.com/shows/ncis/', 0, 100, N'', N'<p><b>NCIS</b> (Naval Criminal Investigative Service) is more than just an action drama. With liberal doses of humor, it''s a show that focuses on the sometimes complex and always amusing dynamics of a team forced to work together in high-stress situations. Leroy Jethro Gibbs, a former Marine gunnery sergeant, whose skills as an investigator are unmatched, leads this troupe of colorful personalities. Rounding out the team are Anthony DiNozzo, an ex-homicide detective whose instincts in the field are unparalleled and whose quick wit and humorous take on life make him a team favorite; the youthful and energetic forensic specialist Abby Sciuto, a talented scientist whose sharp mind matches her Goth style and eclectic tastes; Caitlin Todd, an ex-Secret Service Agent; and Timothy McGee, an MIT graduate whose brilliance with computers far overshadows his insecurities in the field; Assisting the team is medical examiner Dr. Donald "Ducky" Mallard, who knows it all because he''s seen it all, and he''s not afraid to let you know. From murder and espionage to terrorism and stolen submarines, these special agents travel the globe to investigate all crimes with Navy or Marine Corps ties.</p>', 1644414994, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/357/893815.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/357/893815.jpg', N'', N'US', N'United States', N'CBS', N'https://www.cbs.com/', N'', N'', 8.1, N'Monday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (61, N'https://www.tvmaze.com/shows/61/orphan-black', N'Orphan Black', N'Scripted', N'English', N'Drama, Science-Fiction, Thriller', N'Ended', 60, 60, N'2013-03-30', N'2017-08-12', N'http://orphanblack.space.ca/', 0, 95, N'', N'<p><b>Orphan Black</b> is about Sarah, an outsider and orphan whose life changes dramatically after witnessing the suicide of a woman, "Beth", who looks just like her. Sarah takes her identity, her boyfriend and her money. But instead of solving her problems, the street-smart chameleon is thrust headlong into a kaleidoscopic mystery. She makes the dizzying discovery that she and the dead woman are clones... but are they the only ones? Sarah quickly finds herself caught in the middle of a deadly conspiracy, racing to find answers.</p>', 1604505598, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/53/132716.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/53/132716.jpg', N'', N'CA', N'Canada', N'CTV Sci-Fi Channel', N'', N'', N'', 8.7, N'Saturday', N'22:00', 0, N'', N'', N'')
