INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (65, N'https://www.tvmaze.com/shows/65/bones', N'Bones', N'Scripted', N'English', N'Drama, Crime, Medical', N'Ended', 60, 60, N'2005-09-13', N'2017-03-28', N'http://www.fox.com/bones', 0, 98, N'', N'<p>F.B.I. Agent Seeley Booth is teamed up with forensic anthropologist Dr. Temperance "Bones" Brennan to solve some of the most baffling and bizarre crimes ever. Booth depends on clues from the living, witnesses and suspects, while Brennan gathers evidence from the dead, relying on her uncanny ability to read clues left behind in the bones of the victims.</p>', 1619638530, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/80/201202.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/80/201202.jpg', N'', N'US', N'United States', N'FOX', N'', N'', N'', 8.3, N'Tuesday', N'21:00', 0, N'', N'', N'')
