INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (74, N'https://www.tvmaze.com/shows/74/hell-on-wheels', N'Hell on Wheels', N'Scripted', N'English', N'Drama, Action, Western', N'Ended', 60, 60, N'2011-11-06', N'2016-07-23', N'http://www.amctv.com/shows/hell-on-wheels', 0, 88, N'', N'<p><b>Hell on Wheels</b> is an American Western television series about the construction of the First Transcontinental Railroad across the United States. The series follows the Union Pacific Railroad and its surveyors, laborers, prostitutes, mercenaries, and others who lived, worked and died in the mobile encampment called "Hell on Wheels" that followed the railhead west across the Great Plains. In particular, the story focuses on Cullen Bohannon, a former Confederate soldier who, while working as foreman and chief engineer on the railroad, initially attempts to track down the Union soldiers who murdered his wife and young son during the American Civil War.</p>', 1573670489, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/526.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/526.jpg', N'', N'US', N'United States', N'AMC', N'', N'', N'', 8.4, N'Saturday', N'21:00', 0, N'', N'', N'')
