INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (76, N'https://www.tvmaze.com/shows/76/sons-of-anarchy', N'Sons of Anarchy', N'Scripted', N'English', N'Drama, Action, Crime', N'Ended', 60, 60, N'2008-09-03', N'2014-12-09', N'http://www.fxnetworks.com/shows/sons-of-anarchy/', 0, 95, N'', N'<p><b>Sons of Anarchy</b> is an American television drama series created by Kurt Sutter, about the lives of a close-knit outlaw motorcycle club operating in Charming, a fictional town in California''s Central Valley. The show centers on protagonist Jackson "Jax" Teller (Charlie Hunnam), initially the vice president of the club, who begins questioning the club and himself.</p>', 1643787841, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/537.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/537.jpg', N'', N'US', N'United States', N'FX', N'', N'', N'', 8.6, N'Tuesday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (77, N'https://www.tvmaze.com/shows/77/the-middle', N'The Middle', N'Scripted', N'English', N'Comedy, Family', N'Ended', 30, 30, N'2009-09-30', N'2018-05-22', N'http://abc.go.com/shows/the-middle', 0, 91, N'', N'<p>Forget about athletes, movie stars and politicians. Parents are the real heroes - but we think Frankie Heck, must be some kind of superhero. A loving wife and mother of three, she''s middle class in the middle of the country and is rapidly approaching middle age.</p><p>Frankie and her husband, Mike, have lived in Orson, Indiana, their whole lives. A man of few words (every one a zinger), Mike is a manager at the town quarry and Frankie is the third-best used car salesman (out of the three) at the local dealership. She may not be a high-powered career woman, but when it comes to her family, she''ll go to just about any length. And with kids like these, she had better. There''s Axl, her semi-nudist teenage son conceived while under the influence of Guns N'' Roses; Sue, the awkward teenage daughter who fails at everything... but with the utmost of gusto; and their seven-year-old son Brick, whose best friend is his backpack.</p><p>Sometimes it seems like everyone is trying to get to the top, or struggling not to hit bottom, but we think Frankie and her family will find a lot of love, and a lot of laughs, somewhere in <b>The Middle</b>.</p>', 1637451258, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/562.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/562.jpg', N'', N'US', N'United States', N'ABC', N'', N'', N'', 8.4, N'Tuesday', N'20:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (78, N'https://www.tvmaze.com/shows/78/the-mysteries-of-laura', N'The Mysteries of Laura', N'Scripted', N'English', N'Comedy, Crime', N'Ended', 60, 60, N'2014-09-17', N'2016-03-02', N'http://www.nbc.com/the-mysteries-of-laura', 0, 85, N'', N'<p>Laura Diamond is a brilliant NYPD homicide detective who balances her "Columbo" day job with a crazy family life that includes two unruly twin boys and a soon-to-be ex-husband - also a cop - who just can''t seem to sign the divorce papers. Between cleaning up after her boys and cleaning up the streets, she''d be the first to admit she has her "hot mess" moments in this hilariously authentic look at what it really means to be a working mom today. Somehow, she makes it all work with the help of her sexy and understanding partner, and things becomes even more complicated when her husband becomes her boss at the precinct. For Laura, every day is a high-wire balancing act.</p>', 1619728370, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/568.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/568.jpg', N'', N'US', N'United States', N'NBC', N'', N'', N'', 7.6, N'Wednesday', N'20:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (79, N'https://www.tvmaze.com/shows/79/the-goldbergs', N'The Goldbergs', N'Scripted', N'English', N'Comedy, Family', N'Running', 30, 30, N'2013-09-24', N'', N'https://abc.com/shows/the-goldbergs', 0, 99, N'', N'<p>Before there were parenting blogs, trophies for showing up and peanut allergies, there was a simpler time called the ''80s. For geeky and movie obsessed youngest child Adam, these were his wonder years, and he faced them armed with a video camera to capture all the crazy. <b>The Goldbergs</b> are a loving family like any other -- just with a lot more yelling. Mom Beverly is a classic "smother," an overbearing, overprotective matriarch who loves her delicious kids, but still rules this brood with 100% authority and zero sense of boundaries. Dad Murray is gruff and sometimes oblivious, parenting with half his attention span but all his heart. Sister Erica is popular and terrifying, doing her best to cover up that she''s the smartest of the clan. Barry is a passionate dreamer, who maybe dreams a little too big and who always gets the short end of the stick. Adam is the youngest, a camera-wielding future director who''s navigating first love, and growing up with his family. Rounding out the family is beloved grandfather Al "Pops" Solomon, the wild man of the clan, a shameless Don Juan who''s learning as much from his family as he teaches them.</p>', 1644326578, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/359/898258.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/359/898258.jpg', N'', N'US', N'United States', N'ABC', N'https://abc.com/', N'', N'', 7.8, N'Wednesday', N'20:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (80, N'https://www.tvmaze.com/shows/80/modern-family', N'Modern Family', N'Scripted', N'English', N'Comedy, Family', N'Ended', 30, 30, N'2009-09-23', N'2020-04-08', N'http://abc.go.com/shows/modern-family', 0, 97, N'', N'<p><b>Modern Family</b> revolves around three different types of families (nuclear, step- and same-sex) living in the Los Angeles area, who are interrelated through Jay Pritchett and his children, Claire Dunphy (née Pritchett) and Mitchell Pritchett. Patriarch Jay is remarried to a much younger woman, Gloria Delgado Pritchett (née Ramirez), a passionate Colombian with whom he has an infant son, Fulgencio (Joe) Pritchett, and a son from Gloria''s previous marriage, Manny Delgado.</p><p>Jay''s daughter Claire was a homemaker, but has returned to the business world. She is now the chief executive of her father''s previous business, Pritchett''s Closets and Blinds. She is married to Phil Dunphy, a realtor and self-professed "cool dad". They have three children: Haley Dunphy, a stereotypical ditzy teenage girl; Alex Dunphy, a nerdy, smart middle child; and Luke Dunphy, the off-beat only son.</p><p>Jay''s lawyer son Mitchell and his husband Cameron Tucker have one daughter, Lily Tucker-Pritchett. As the name suggests, this family represents a modern-day family, and episodes are comically based on situations which many families encounter in real life.</p>', 1643697963, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/359/898320.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/359/898320.jpg', N'', N'US', N'United States', N'ABC', N'https://abc.com/', N'', N'', 7.7, N'Wednesday', N'21:00', 0, N'', N'', N'')
