INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (82, N'https://www.tvmaze.com/shows/82/game-of-thrones', N'Game of Thrones', N'Scripted', N'English', N'Drama, Adventure, Fantasy', N'Ended', 60, 61, N'2011-04-17', N'2019-05-19', N'http://www.hbo.com/game-of-thrones', 0, 99, N'', N'<p>Based on the bestselling book series <i>A Song of Ice and Fire</i> by George R.R. Martin, this sprawling new HBO drama is set in a world where summers span decades and winters can last a lifetime. From the scheming south and the savage eastern lands, to the frozen north and ancient Wall that protects the realm from the mysterious darkness beyond, the powerful families of the Seven Kingdoms are locked in a battle for the Iron Throne. This is a story of duplicity and treachery, nobility and honor, conquest and triumph. In the <b>Game of Thrones</b>, you either win or you die.</p>', 1644209052, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/190/476117.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/190/476117.jpg', N'', N'US', N'United States', N'HBO', N'https://www.hbo.com/', N'', N'', 9, N'Sunday', N'21:00', 0, N'US', N'United States', N'HBO Go')
