INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (84, N'https://www.tvmaze.com/shows/84/family-guy', N'Family Guy', N'Animation', N'English', N'Comedy, Family', N'Running', 30, 30, N'1999-01-31', N'', N'http://www.fox.com/family-guy', 0, 99, N'', N'<p><b>Family Guy</b> follows Peter Griffin the endearingly ignorant dad, and his hilariously offbeat family of middle-class New Englanders in Quahog, RI. Lois is Peter''s wife, a stay-at-home mom with no patience for her family''s antics. Then there are their kids: 18-year-old Meg is an outcast at school and the Griffin family punching bag; 13-year-old Chris is a socially awkward teen who doesn''t have a clue about the opposite sex; and one-year-old Stewie is a diabolically clever baby whose burgeoning sexuality is very much a work in progress. Rounding out the Griffin household is Brian the family dog and a ladies'' man who is one step away from AA.</p>', 1644157879, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/355/889304.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/355/889304.jpg', N'', N'US', N'United States', N'FOX', N'https://www.fox.com/', N'', N'', 7.6, N'Sunday', N'21:30', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (86, N'https://www.tvmaze.com/shows/86/stalker', N'Stalker', N'Scripted', N'English', N'Crime, Thriller', N'Ended', 60, 60, N'2014-10-01', N'2015-05-18', N'', 0, 85, N'', N'<p><b>Stalker</b> is a psychological thriller about detectives who investigate stalking incidents - including voyeurism, cyber harassment and romantic fixation - for the Threat Assessment Unit of the LAPD. Det. Jack Larsen is a recent transfer to the Unit from New York City''s homicide division, whose confidence, strong personality and questionable behavior has landed him in trouble before - but whose past behavior may also prove valuable in his new job. His boss, Lt. Beth Davis, is strong, focused and an expert in the field, driven by her traumatic personal experience as a victim. With the rest of their team, young but eager Det. Ben Caldwell and deceptively smart Det. Janice Lawrence Larsen and Davis assess the threat level of cases and respond before the stalking and intimidation spirals out of control, all while trying to keep their personal obsessions at bay.</p>', 1577705838, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/647.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/647.jpg', N'', N'US', N'United States', N'CBS', N'', N'', N'', 7.5, N'Wednesday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (87, N'https://www.tvmaze.com/shows/87/the-bridge', N'The Bridge', N'Scripted', N'English', N'Drama, Crime, Thriller', N'Ended', 60, 60, N'2013-07-10', N'2014-10-01', N'', 0, 91, N'', N'<p>When the body of a cartel member is found on US soil, Sonya Cross from El Paso PD and her Mexican counterpart, Marco Ruiz must work together to solve the case.</p><p>A present-day crime thriller exploring the tensions on the US-Mexico border. When an American judge known for her anti-immigration views is found dead on the bridge connecting El Paso and Juarez, Sonya Cross from El Paso PD must work with her Mexican counterpart from Chihuahua State Police, Marco Ruiz, to catch a serial killer operating on both sides of the border. Marco understands the slippery politics of Mexican law enforcement, and while his police force slowly succumbs to the pressures and demands of the cartel, he''s one of the last good men in the department. He''s charming but will do whatever it takes to get what he needs -- which doesn''t sit well with Sonya, who has Asperger''s and strictly follows rules and protocol. The case quickly pulls them into a string of murders on the border, a scene already consumed by illegal immigration, drug trafficking, violence, and prostitution.</p>', 1614842618, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/649.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/649.jpg', N'', N'US', N'United States', N'FX', N'', N'', N'', 7.4, N'Wednesday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (88, N'https://www.tvmaze.com/shows/88/reign', N'Reign', N'Scripted', N'English', N'Drama, Romance, History', N'Ended', 60, 60, N'2013-10-17', N'2017-06-16', N'', 0, 89, N'', N'<p>Hidden between the lines of the history books is the story of Mary Stuart, the young woman the world would come to know as Mary, Queen of Scots. Queen of Scotland since she was six days old, the teenage Mary is already a headstrong monarch - beautiful, passionate, and poised at the very beginning of her tumultuous rise to power. Arriving in France with four close friends as her ladies-in-waiting, Mary has been sent to secure Scotland''s strategic alliance by formalizing her arranged engagement to the French king''s dashing son, Prince Francis. But the match isn''t signed and sealed, it depends more on politics, religion and secret agendas than affairs of the heart. With danger and sexual intrigue around every dark castle corner, Mary rallies her ladies-in-waiting and steels herself, ready to rule the new land and balance the demands of her country and her heart.</p>', 1579368436, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/81/204119.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/81/204119.jpg', N'', N'US', N'United States', N'The CW', N'', N'', N'', 7.4, N'Friday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (89, N'https://www.tvmaze.com/shows/89/unforgettable', N'Unforgettable', N'Scripted', N'English', N'Drama, Crime', N'Ended', 60, 60, N'2011-09-20', N'2016-01-22', N'http://www.aetv.com/unforgettable', 0, 97, N'', N'<p><b>Unforgettable</b> follows Carrie Wells, an enigmatic former police detective with a rare condition that makes her memory so flawless that every place, every conversation, every moment of joy and every heartbreak is forever embedded in her mind. It''s not just that she doesn''t forget anything - she can''t; except for one thing: the details that would help solve her sister''s long-ago murder. Carrie has tried to put her past behind her, but she''s unexpectedly reunited with her ex-boyfriend and partner, NYPD Detective Al Burns when she consults on a homicide case.</p>', 1638588177, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/663.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/663.jpg', N'', N'US', N'United States', N'A&E', N'', N'', N'', 7.4, N'Friday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (90, N'https://www.tvmaze.com/shows/90/haven', N'Haven', N'Scripted', N'English', N'Drama, Crime, Supernatural', N'Ended', 42, 60, N'2010-07-09', N'2015-12-17', N'http://www.syfy.com/haven', 0, 95, N'', N'<p>When FBI Special Agent Audrey Parker is dispatched to the small town of <b>Haven</b>, Maine, on a routine case, she soon finds herself increasingly involved in the return of "The Troubles", a plague of supernatural afflictions that have occurred in the town at least twice before. With an openness to the possibility of the paranormal, she also finds a more personal link in Haven that may lead her to the mother she has never known.</p><p>She and her partner, police detective Nathan Wuornos, find themselves frequently facing problems caused by both the effects of the Troubles, as well as the activities of town folk who take more drastic measures against those who are Troubled.</p>', 1638776835, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/672.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/672.jpg', N'', N'US', N'United States', N'Syfy', N'', N'', N'', 8.1, N'Thursday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (91, N'https://www.tvmaze.com/shows/91/bad-judge', N'Bad Judge', N'Scripted', N'English', N'Comedy, Family', N'Ended', 30, 30, N'2014-10-02', N'2015-01-22', N'', 0, 55, N'', N'<p>No excuses, no apologies, no compromises. Wild child Rebecca Wright knows how to have a good time, but she also happens to be one of L.A.''s toughest and most respected criminal court judges. She has a reputation for unorthodox behavior in the courtroom, including creative rulings and saying exactly what''s on her mind. Her private life, on the other hand, is anything but innocent. She parties too much and rocks out on the drums in a band with her best friend, Jenny. While there''s no shortage of male admirers who would love to spend time with her, she''s not ready to settle down... except when an 8-year-old boy - whose parents were put in jail by Rebecca - needs her help. He may, in fact, be the one thing that starts to tame this <b>Bad Judge</b>.</p>', 1579722192, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/678.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/678.jpg', N'', N'US', N'United States', N'NBC', N'', N'', N'', 7.5, N'Thursday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (92, N'https://www.tvmaze.com/shows/92/a-to-z', N'A to Z', N'Scripted', N'English', N'Comedy, Romance', N'Ended', 30, 30, N'2014-10-02', N'2015-01-22', N'', 0, 49, N'', N'<p>This is the <b>A to Z</b> story of Andrew and Zelda - a pair that almost wasn''t - and all that happened from the day they met. Andrew has always been a secret romantic... not above crooning to Celine Dion while driving to work, with dreams of finding "the one." He imagines her to be just like that shimmering beauty he spotted that night in that silver dress at that concert two years ago. Zelda, having grown up with a hippie mom who believed the universe would provide for everything, rebelled into a no-nonsense practical lawyer who prefers the control of online dating. But when a computer glitch sends her a total mismatch, she''s asked to come in for an interview at the Internet dating site where Andrew works, and this is where it all begins. Andrew and Zelda meet for the first time and despite their differences, sparks fly. She thinks it''s chance. He thinks it''s fate. After all, he''s convinced she''s the shimmering girl in the silver dress. Is it true love forever or just a detour in destiny?</p>', 1631816813, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/679.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/679.jpg', N'', N'US', N'United States', N'NBC', N'', N'', N'', 6.8, N'Thursday', N'21:30', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (93, N'https://www.tvmaze.com/shows/93/parenthood', N'Parenthood', N'Scripted', N'English', N'Drama, Comedy, Family', N'Ended', 60, 60, N'2010-03-02', N'2015-01-29', N'', 0, 93, N'', N'<p><b>Parenthood</b> is the critically acclaimed one-hour drama inspired by the box office hit of the same name. This reimagined and updated Universal Television/Imagine Entertainment production follows the trials and tribulations of the very large, colorful and imperfect Braverman family. Sarah Braverman is a single mother with two kids - the bright but rebellious Amber who is living on her own, and sullen and sensitive Drew who returns to Berkeley this year.</p>', 1643808958, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/685.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/685.jpg', N'', N'US', N'United States', N'NBC', N'https://www.nbc.com/', N'', N'', 8.1, N'Thursday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (94, N'https://www.tvmaze.com/shows/94/defiance', N'Defiance', N'Scripted', N'English', N'Action, Adventure, Science-Fiction', N'Ended', 60, 62, N'2013-04-15', N'2015-08-28', N'', 0, 97, N'', N'<p>Set on a future Earth, <b>Defiance</b> introduces players and viewers to a world where humans and aliens live together on a planet ravaged by decades of war and transformed by alien terra-forming machines. It centers on Jeb Nolan, the law-keeper in a bustling frontier boomtown that is one of the new world''s few oasis of civility and inclusion. Nolan is a former Marine who fought in the alien conflict and suffered the loss of his wife and child in the war. The trauma transformed him into a lone wanderer in the wilds of this new and dangerous world.</p>', 1640482672, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/700.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/700.jpg', N'', N'US', N'United States', N'Syfy', N'', N'', N'', 7.8, N'Thursday', N'20:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (95, N'https://www.tvmaze.com/shows/95/falling-skies', N'Falling Skies', N'Scripted', N'English', N'Drama, Action, Science-Fiction', N'Ended', 60, 60, N'2011-06-19', N'2015-08-30', N'', 0, 97, N'', N'<p>The series tells the story of the aftermath of a global invasion by several races of extraterrestrials that neutralizes the world''s power grid and technology, quickly destroys the combined militaries of all the world''s countries, and apparently kills over 90% of the human population within a few days.</p>', 1643089840, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/716.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/716.jpg', N'', N'US', N'United States', N'TNT', N'', N'', N'', 7.6, N'Sunday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (96, N'https://www.tvmaze.com/shows/96/manhattan-love-story', N'Manhattan Love Story', N'Scripted', N'English', N'Comedy, Romance', N'Ended', 30, 30, N'2014-09-30', N'2014-12-04', N'https://abc.go.com/shows/manhattan-love-story', 0, 48, N'', N'<p>Have you ever wondered what your date was thinking? This romantic comedy exposes the differences between men and women through the unfiltered thoughts, and often contradictory actions, of a new couple who have just begun dating.</p>', 1574386332, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/729.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/729.jpg', N'', N'US', N'United States', N'ABC', N'', N'', N'', 5.3, N'Tuesday', N'20:30', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (97, N'https://www.tvmaze.com/shows/97/the-biggest-loser', N'The Biggest Loser', N'Reality', N'English', N'Drama', N'Running', 60, 62, N'2004-10-19', N'', N'https://www.usanetwork.com/the-biggest-loser', 0, 74, N'', N'<p>NBC''s <b>The Biggest Loser</b>, a show known for its incredible weight loss makeovers, will reveal an exciting makeover of its own when the popular series returns on Monday, January 4 (9-11 p.m. ET) with new host Bob Harper, a new "Temptation" theme, an updated state-of-the-art gym, a new logo, fun format changes and a return to the popular team vs. team competition. Dolvett Quince and Jen Widerstrom return to train eight contestant teams of two, all with compelling stories. Seven teams (spouses, parent/adult child, siblings, relatives, best friends) will know each other, but one team will be two strangers - former "Celebrity Apprentice" contestant and the original "Survivor" winner, Richard Hatch, and ''The Voice'' season two semi-finalist Erin Willett. Having both been in the NBC family previously, the two share the same goal as the other 14 contestants - to change their lives and get healthy. The renovated "Biggest Loser" gym, featuring a new interior and exterior branded with the new logo, has modernized equipment to help contestants better achieve their fitness goals, including eight high-tech monitors on the walls of each side of the gym that will track contestants'' calorie burns as well as heart rates. Half of the gym will be dedicated to Team Dolvett and the other half dedicated to Team Jen. The weigh-in will be very different this season with a new look and double scales, so contestants on opposing teams can weigh-in side by side, making the weigh-in even more compelling to watch. The contestant house is also getting a whole new look for season 17.</p>', 1639253327, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/730.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/730.jpg', N'', N'US', N'United States', N'USA Network', N'', N'', N'', 6, N'Tuesday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (98, N'https://www.tvmaze.com/shows/98/scandal', N'Scandal', N'Scripted', N'English', N'Drama, Thriller', N'Ended', 60, 60, N'2012-04-05', N'2018-04-19', N'http://abc.go.com/shows/scandal', 0, 95, N'', N'<p>Everyone has secrets… and Olivia Pope has dedicated her life to protecting and defending the public images of the nation''s elite by keeping those secrets under wraps. Pope''s team are at the top of their game when it comes to getting the job done for their clients, but it becomes apparent that these "gladiators in suits", who specialize in fixing the lives of other people, have trouble fixing those closest at hand -- their own.</p>', 1625767135, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/303/758518.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/303/758518.jpg', N'', N'US', N'United States', N'ABC', N'', N'', N'', 7.9, N'Thursday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (99, N'https://www.tvmaze.com/shows/99/americas-next-top-model', N'America''s Next Top Model', N'Reality', N'English', N'', N'Ended', 60, 60, N'2003-05-20', N'2018-04-11', N'http://www.vh1.com/shows/americas-next-top-model', 0, 90, N'', N'<p>Created by supermodel Tyra Banks, <b>America''s Next Top Model</b> follows a group of young women of various backgrounds, shapes and sizes who live together in a loft and vie for a modeling contract. The show exposes the transformation of everyday young women into potentially fierce supermodels, with participants facing weekly tests that determine who can make the cut. With mentoring by supermodel Tyra Banks and exposure to high-profile fashion-industry gurus, the finalists compete in a highly accelerated modeling boot camp--a crash course to supermodel fame.</p>', 1639427086, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/147/369365.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/147/369365.jpg', N'', N'US', N'United States', N'VH1', N'', N'', N'', 5.7, N'Wednesday', N'20:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (100, N'https://www.tvmaze.com/shows/100/blue-bloods', N'Blue Bloods', N'Scripted', N'English', N'Drama, Crime', N'Running', 60, 60, N'2010-09-24', N'', N'http://www.cbs.com/shows/blue_bloods/', 0, 100, N'', N'<p><b>Blue Bloods </b>is a drama about a multi-generational family of cops dedicated to New York City law enforcement. Frank Reagan is the New York Police Commissioner and heads both the police force and the Reagan brood. He runs his department as diplomatically as he runs his family, even when dealing with the politics that plagued his unapologetically bold father, Henry, during his stint as Chief. A source of pride and concern for Frank is his eldest son Danny, a seasoned detective, family man and Iraq War vet who on occasion uses dubious tactics to solve cases with his loyal and tough partner, Detective Jackie Curatola. The Reagan women in the family include Erin, a N.Y. Assistant D.A., who also serves as the legal compass for her siblings and father, and single parent to her teenage daughter Nicky; and Linda, Danny''s supportive wife. Jamie is the youngest Reagan, a recent grad of Harvard Law and the family''s "golden boy." Unable to deny the family tradition, Jamie has decided to give up a lucrative future in law and follow in the family footsteps as a cop.</p>', 1644415001, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/361/903737.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/361/903737.jpg', N'', N'US', N'United States', N'CBS', N'https://www.cbs.com/', N'', N'', 8.3, N'Friday', N'22:00', 0, N'', N'', N'')
