INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (104, N'https://www.tvmaze.com/shows/104/dominion', N'Dominion', N'Scripted', N'English', N'Action, Adventure, Fantasy', N'Ended', 60, 60, N'2014-06-19', N'2015-10-01', N'http://www.syfy.com/dominion', 0, 82, N'', N'<p><b>Dominion </b>is an epic supernatural drama set in the near future. Specifically, 25 years after "The Extinction War," when an army of lower angels, assembled by the archangel Gabriel, waged war against mankind. The archangel Michael, turning against his own kind, chose to side with humanity. Rising out of the ashes of this long battle are newly fortified cities which protect human survivors. At the center of the series is the city of Vega, a glistening empire that has formed from the ruins of what was once Las Vegas.</p>', 1604080850, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/775.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/775.jpg', N'', N'US', N'United States', N'Syfy', N'', N'', N'', 7.1, N'Thursday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (105, N'https://www.tvmaze.com/shows/105/from-dusk-till-dawn-the-series', N'From Dusk Till Dawn: The Series', N'Scripted', N'English', N'Action, Crime, Horror', N'Ended', 60, 60, N'2014-03-11', N'2016-11-01', N'http://www.elreynetwork.com/originals/from-dusk-till-dawn-s3', 0, 50, N'', N'<p><b>From Dusk Till Dawn: The Series</b>, based on the thrill-ride film of the same name, is a supernatural crime saga centered around bank robber, Seth Gecko and his violent, unpredictable brother, Richard "Richie" Gecko, who are wanted by the FBI and Texas Rangers Earl McGraw and Freddie Gonzalez after a bank heist leaves several people dead. While on the run to Mexico, Seth and Richie encounter former pastor Jacob Fuller and his family, whom they take hostage. Using the family RV to cross the border, chaos ensues when the group detours to a strip club that is populated by vampires. They are forced to fight until dawn in order to get out alive.</p>', 1619427719, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/70/176381.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/70/176381.jpg', N'', N'US', N'United States', N'El Rey Network', N'', N'', N'', 6.5, N'Tuesday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (106, N'https://www.tvmaze.com/shows/106/justified', N'Justified', N'Scripted', N'English', N'Drama, Crime, Western', N'Ended', 60, 60, N'2010-03-16', N'2015-04-14', N'', 0, 97, N'', N'<p>Deputy U.S. Marshal Raylan Givens is something of a 19th century-style officer in modern times, whose unconventional enforcement of justice makes him a target with criminals and a problem for his superiors in the U.S. Marshals Service. As a result of an eager but "justified" shooting of a Miami fugitive while on assignment in Florida, Givens is reassigned to Lexington, Kentucky, in a district that includes his hometown of Harlan, a rural mining town in the east of the state.</p>', 1626200210, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/808.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/808.jpg', N'', N'US', N'United States', N'FX', N'', N'', N'', 8.9, N'Tuesday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (107, N'https://www.tvmaze.com/shows/107/bobs-burgers', N'Bob''s Burgers', N'Animation', N'English', N'Comedy, Family', N'Running', 30, 30, N'2011-01-09', N'', N'http://www.fox.com/bobs-burgers', 0, 99, N'', N'<p>The series follows Bob who runs <b>Bob''s Burgers</b>, with the help of his wife and their three kids. Bob has big ideas about burgers, but the rest of the clan falls short on service. Despite the greasy counters and lousy location, the Belchers are determined to make every "Grand Re-Re-Re-opening" a success. Bob''s wife, Linda, stands by her man and often does so by bursting into song. Their eldest daughter, 13-year-old Tina has a slight obsession with boys and zombies. Middle child Gene is an aspiring musician with a thirst for life. Louise is the bunny ears-wearing youngest daughter with an off-kilter sense of humor that makes her somewhat of a liability in the kitchen – and with the public.</p>', 1644456594, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/359/898434.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/359/898434.jpg', N'', N'US', N'United States', N'FOX', N'https://www.fox.com/', N'', N'', 8.1, N'Sunday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (108, N'https://www.tvmaze.com/shows/108/mulaney', N'Mulaney', N'Scripted', N'English', N'Comedy, Family', N'Ended', 30, 30, N'2014-10-05', N'2015-02-15', N'', 0, 62, N'', N'<p>John Mulaney is a 29-year-old comedian working the stand-up circuit and looking for his big break. But life drastically changes when self-centered comedy legend and game show host Lou Cannon hires Mulaney as a writer. Lou may be John''s entrée into the world of big-money show business, but he''s also a total nightmare. Still, the job represents everything Mulaney thinks he wants. But does he really? And, at what cost? And what does it say about him if he quits? And what does it say about him if he stays? And has Lou had work done?</p>', 1617643279, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/846.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/846.jpg', N'', N'US', N'United States', N'FOX', N'', N'', N'', 6, N'Sunday', N'21:30', 0, N'', N'', N'')
