INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (110, N'https://www.tvmaze.com/shows/110/gracepoint', N'Gracepoint', N'Scripted', N'English', N'Drama, Crime, Mystery', N'Ended', 60, 60, N'2014-10-02', N'2014-12-11', N'', 0, 88, N'', N'<p>When a young boy is found dead on an idyllic beach, a major police investigation gets underway in the small California seaside town where the tragedy occurred. Soon deemed a homicide, the case sparks a media frenzy, which throws the boy''s family into further turmoil and upends the lives of all of the town''s residents. Welcome to <b>Gracepoint</b>, a new 10-episode mystery event series based on "Broadchurch," the U.K.''s critically acclaimed hit crime drama.</p>', 1642104373, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/862.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/862.jpg', N'', N'US', N'United States', N'FOX', N'', N'', N'', 7.7, N'Thursday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (111, N'https://www.tvmaze.com/shows/111/once-upon-a-time', N'Once Upon a Time', N'Scripted', N'English', N'Drama, Fantasy, Romance', N'Ended', 60, 60, N'2011-10-23', N'2018-05-18', N'http://abc.go.com/shows/once-upon-a-time', 0, 97, N'', N'<p><b>Once Upon a Time</b> is Fairy Tale Land. It''s filled with magic, monsters and all of the characters we all know from stories growing up. It''s real, and so are the people in it. But unlike the "happily ever after" you may have heard about, their stories continued, and The Evil Queen cast a Dark Curse over the land...</p><p>This is Storybrooke. It''s a quiet, little New England town filled with people who go about their everyday lives with no idea who they really are. The Queen''s Curse has trapped them here and placed her in near-complete control. They have no real memories and no real hope.</p>', 1643737323, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/127/319360.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/127/319360.jpg', N'', N'US', N'United States', N'ABC', N'https://abc.com/', N'', N'', 7.5, N'Friday', N'20:00', 0, N'', N'', N'')
