INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (120, N'https://www.tvmaze.com/shows/120/transparent', N'Transparent', N'Scripted', N'English', N'Drama, Comedy', N'Ended', 0, 30, N'2014-09-26', N'2017-09-22', N'https://www.amazon.com/dp/B017I3KWX6', 0, 86, N'', N'<p>In <b>Transparent</b>, an LA family with serious boundary issues have their past and future unravel when a dramatic admission causes everyone''s secrets to spill out.</p>', 1633453422, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/210/525553.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/210/525553.jpg', N'', N'', N'', N'', N'', N'', N'', 7.3, N'', N'', 0, N'', N'', N'Amazon Prime Video')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (122, N'https://www.tvmaze.com/shows/122/nikita', N'Nikita', N'Scripted', N'English', N'Action', N'Ended', 60, 60, N'2010-09-09', N'2013-12-27', N'', 0, 91, N'', N'<p>When she was a deeply troubled teenager, Nikita was rescued from death row by a secret U.S. agency known only as Division, who trained her as a spy and assassin. Nikita was eventually betrayed by the only people she thought she could trust. Now, after three years in hiding, Nikita is seeking retribution and making it clear to her former boss, Percy and her former friends Michael and Birkhoff that she will stop at nothing to expose and destroy their covert operation.</p>', 1604433237, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/1366.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/1366.jpg', N'', N'US', N'United States', N'The CW', N'', N'', N'', 8, N'Friday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (123, N'https://www.tvmaze.com/shows/123/lost', N'Lost', N'Scripted', N'English', N'Drama, Adventure, Supernatural', N'Ended', 60, 60, N'2004-09-22', N'2010-05-23', N'http://abc.go.com/shows/lost', 0, 98, N'', N'<p>Out of the blackness, the first thing Jack senses is pain. Then burning sun. A Bamboo forest. Smoke. Screams. With a rush comes the horrible awareness that the plane he was on tore apart in mid-air and crashed on a Pacific island. From there it''s a blur, as his doctor''s instinct kicks in: people need his help.</p><p>Stripped of everything, the 48 survivors scavenge what they can from the plane for their survival. Some panic. Some pin their hopes on rescue. A few find inner strength they never knew they had -- like Kate, who, with no medical training, suddenly finds herself suturing the doctor''s wounds. Hurley - a man with a warm sense of humor despite the desperate situation - does his best to keep his cool as he helps those around him to survive. Charlie is a faded rock star who harbors a painful secret. Sayid is a Middle Eastern man who must wrestle with the racial profiling directed at him by some of his fellow survivors. Jin and Sun are a Korean couple whose traditions, values and language are foreign, and thus causes much to get lost in the translation. Sawyer has an air of danger surrounding him, and his intense sense of mistrust for everyone around him could prove to be fatal to his fellow castaways. Michael has just gained custody of his nine-year-old son, Walt, after the death of his ex-wife - they are a father and son who don''t even know each other. Locke is a mysterious man who keeps to himself, and who harbors a deeper connection to the island than any of the others. Self-centered Shannon - who actually gives herself a pedicure amid the chaos - and her estranged controlling brother, Boone , constantly bicker and must learn to get along if they are to survive. And young Claire is eight months pregnant and ill-prepared for the hardships of motherhood - especially on a deserted island.</p>', 1623877180, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/1389.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/1389.jpg', N'', N'US', N'United States', N'ABC', N'', N'', N'', 8.3, N'Tuesday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (124, N'https://www.tvmaze.com/shows/124/2-broke-girls', N'2 Broke Girls', N'Scripted', N'English', N'Comedy', N'Ended', 30, 30, N'2011-09-19', N'2017-04-17', N'http://www.cbs.com/shows/2_broke_girls/', 0, 96, N'', N'<p><b>2 Broke Girls</b> is a comedy about two young women waitressing at a greasy spoon diner who strike up an unlikely friendship in the hopes of launching a successful business - if only they can raise the cash. Sassy, streetwise Max Black works two jobs just to get by, one of which is waiting tables during the night shift at the retro-hip Williamsburg Diner. Sophisticated Caroline Channing is an uptown trust fund princess who''s having a run of bad luck that forces her to reluctantly give waitressing a shot. At first, Max sees Caroline as yet another in a long line of inept servers she must cover for, but she''s surprised to find that Caroline has as much substance as she does style.</p><p>When Caroline discovers Max''s knack for baking amazing cupcakes, she sees a lucrative future for them, but first they need to raise the start-up money. While they save their tips, they''ll stay at the restaurant, working with Oleg, an overly flirtatious Russian cook; Earl, a 75-year-old kool-kat cashier; and Han Lee, the new, eager-to-please owner of the diner. Working together, these two broke girls living in one expensive city might just find the perfect recipe for their big break.</p>', 1618620900, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/63/158548.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/63/158548.jpg', N'', N'US', N'United States', N'CBS', N'', N'', N'', 7.1, N'Monday', N'21:30', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (125, N'https://www.tvmaze.com/shows/125/selfie', N'Selfie', N'Scripted', N'English', N'Comedy, Romance', N'Ended', 30, 30, N'2014-09-30', N'2014-12-30', N'', 0, 63, N'', N'<p>Eliza Dooley has 263,000 followers who hang on to her every post, tweet and selfie. But one lonely day, she has a revelation: being friended is not the same as having actual friends. She asks marketing guru Henry to ''rebrand'' her self-obsessed reputation and teach her how to connect with people in the real world. Loosely based on <i>My Fair Lady</i>, <b>Selfie</b> explores the modern struggles of Eliza and Henry, as he tries to teach her how to live life offline - whether she ''likes'' it or not.</p>', 1618713775, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/1756.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/1756.jpg', N'', N'US', N'United States', N'ABC', N'', N'', N'', 7, N'Tuesday', N'20:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (126, N'https://www.tvmaze.com/shows/126/mom', N'Mom', N'Scripted', N'English', N'Comedy, Family', N'Ended', 30, 30, N'2013-09-23', N'2021-05-13', N'http://www.cbs.com/shows/mom/', 0, 95, N'', N'<p>Christy is a single mom who, after years of questionable choices, is now sober and trying to get her life on track. She''s tested daily by her newly sober mother, Bonnie, who is trying to make up for all the ways she''s let Christy down. Christy is further challenged by her relationships with her own kids. Her daughter Violet is engaged to a man twice her age and her ten-year-old son, Roscoe, would rather live with his father Baxter, a former slacker who has only recently gotten himself together. To help her stay sober, Christy relies on her support system from AA, comprised of her sponsor Marjorie, her wealthy sponsee, Jill, and her emotional friend, Wendy. Christy tries to remain positive as she attempts to overcome her past and build a better future, but with her dysfunctional family and life''s many setbacks, it''s always an uphill battle.</p>', 1621211448, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/300/751117.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/300/751117.jpg', N'', N'US', N'United States', N'CBS', N'', N'', N'', 7.6, N'Thursday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (127, N'https://www.tvmaze.com/shows/127/the-affair', N'The Affair', N'Scripted', N'English', N'Drama, Romance', N'Ended', 60, 61, N'2014-10-12', N'2019-11-03', N'http://www.sho.com/sho/the-affair/home', 0, 91, N'', N'<p>At once deeply observed and intriguingly elusive, <b>The Affair</b> explores the emotional effects of an extramarital relationship.</p><p>Noah is a New York City schoolteacher and novelist who is happily married, but resents his dependence on his wealthy father-in-law. Alison is a young waitress trying to piece her life and marriage back together in the wake of a tragedy. The provocative drama unfolds when Alison and Noah meet in Montauk at the end of Long Island.</p>', 1634841999, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/203/509941.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/203/509941.jpg', N'', N'US', N'United States', N'Showtime', N'', N'', N'', 7.7, N'Sunday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (128, N'https://www.tvmaze.com/shows/128/jane-the-virgin', N'Jane the Virgin', N'Scripted', N'English', N'Drama, Comedy, Romance', N'Ended', 60, 60, N'2014-10-13', N'2019-07-31', N'http://www.cwtv.com/shows/jane-the-virgin', 0, 92, N'', N'<p>When Jane Villanueva was a young girl, her grandmother, Alba, convinced her of two things: telenovelas are the highest form of entertainment, and women must protect their virginity at all costs. Jane the Virgin, although she has always tried to be the good girl who does the right thing, Jane''s life has suddenly become as dramatic and complicated as the telenovelas she has always loved.</p>', 1626378663, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/186/466352.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/186/466352.jpg', N'', N'US', N'United States', N'The CW', N'', N'', N'', 7.4, N'Wednesday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (129, N'https://www.tvmaze.com/shows/129/marry-me', N'Marry Me', N'Scripted', N'English', N'Comedy', N'Ended', 30, 30, N'2014-10-14', N'2015-05-14', N'', 0, 47, N'', N'<p>Six years ago, Annie and Jake bonded over their mutual love of nachos and they''ve been inseparable ever since. Now, after returning from a romantic two-week island vacation, Jake''s all set to pop the question. Before he can ask, though, Annie lets loose on Jake for his inability to commit. She was expecting him to "put a ring on it" in paradise and now Jake''s perfect proposal is ruined. Not wanting to spend the next 60 years talking about that mess of a proposal, Jake and Annie decide to hold off on the engagement until they can do it right. Yet if history tells us anything, it''s when we really want things to go right that they all tend to go wrong. The only thing we know for sure is these two are destined to be together whether they can get it together or not.</p>', 1577613723, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/1836.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/1836.jpg', N'', N'US', N'United States', N'NBC', N'', N'', N'', 6, N'Tuesday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (130, N'https://www.tvmaze.com/shows/130/two-and-a-half-men', N'Two and a Half Men', N'Scripted', N'English', N'Comedy', N'Ended', 30, 30, N'2003-09-22', N'2015-02-19', N'http://www.cbs.com/shows/two_and_a_half_men/', 0, 98, N'', N'<p>Charlie is a well-to-do bachelor with a house at the beach, a Jaguar in the front, and an easy way with women. His casual Malibu lifestyle is interrupted when his tightly wound brother Alan, who''s facing a divorce, and his son Jake, come to live with him. Together, these two and a half men confront the challenges of growing up; finally. Complicating matters are the brothers'' self-obsessed, controlling mother, Evelyn, Alan''s estranged wife, Judith and Charlie''s crazy neighbor Rose, who wants to be a part of his life and is willing to do anything to be around. After the death of his brother, Alan Harper meets and befriends a lonely young man named Walden Schmidt who turns out to be a billionaire. Unable to afford his brother''s home, Alan sells Walden the house, and as a way of showing his gratitude, Walden allows Alan and his son Jake to move in with him.</p>', 1641238991, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/118/296850.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/118/296850.jpg', N'', N'US', N'United States', N'CBS', N'', N'', N'', 6.4, N'Thursday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (131, N'https://www.tvmaze.com/shows/131/about-a-boy', N'About a Boy', N'Scripted', N'English', N'Drama, Comedy, Romance', N'Ended', 30, 30, N'2014-02-22', N'2015-07-20', N'http://www.nbc.com/about-a-boy?nbc=1', 0, 48, N'', N'<p>Will Freeman lives a charmed existence as the ultimate man-child. After writing a hit song, he was granted a life of free time, free love and freedom from financial woes. He''s single, unemployed and loving it. So imagine his surprise when Fiona, a needy, single mom and her oddly charming 11-year-old son Marcus move in next door and disrupt his perfect world.</p>', 1626372918, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/1880.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/1880.jpg', N'', N'US', N'United States', N'NBC', N'', N'', N'', 6.9, N'Tuesday', N'21:30', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (132, N'https://www.tvmaze.com/shows/132/the-millers', N'The Millers', N'Scripted', N'English', N'Comedy', N'Ended', 30, 30, N'2013-10-03', N'2015-07-18', N'http://www.cbs.com/shows/the-millers/', 0, 72, N'', N'<p><b>The Millers</b> follows Nathan Miller, a recently divorced local roving news reporter looking forward to living the singles life until his parents'' marital problems unexpectedly derail his plans. After Nathan finally breaks the news of his divorce to his parents Carol and Tom, his father is inspired to follow suit and stuns the family when he leaves his wife of 43 years. Already in shock, Nathan is even more aghast when his meddlesome mom decides to move in with him. Meanwhile, his absent-minded dad imposes upon Nathan''s sister Debbie, her husband Adam and their daughter. Nathan''s best friend and news cameraman Ray was excited to be Nathan''s wingman in the dating scene, but Carol manages to even cramp his style. Now, as Nathan and his sister settle in with their truly impossible parents, they both wonder just how long the aggravating adjustment period is going to last.</p>', 1630564021, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/1886.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/1886.jpg', N'', N'US', N'United States', N'CBS', N'', N'', N'', 6.4, N'Saturday', N'20:30', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (133, N'https://www.tvmaze.com/shows/133/elementary', N'Elementary', N'Scripted', N'English', N'Drama, Crime, Mystery', N'Ended', 60, 60, N'2012-09-27', N'2019-08-15', N'http://www.cbs.com/shows/elementary/', 0, 97, N'', N'<p><b>Elementary </b>is a modern-day take on the classic Sherlock Holmes story about a crime-solving duo that cracks the NYPD''s most impossible cases. Following his fall from grace in London and a stint in rehab, eccentric Sherlock escapes to Manhattan where his wealthy father forces him to live with his worst nightmare - a sober companion, Dr. Watson.</p>', 1642713080, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/195/488201.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/195/488201.jpg', N'', N'US', N'United States', N'CBS', N'https://www.cbs.com/', N'', N'', 8.3, N'Thursday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (134, N'https://www.tvmaze.com/shows/134/heroes', N'Heroes', N'Scripted', N'English', N'Action, Science-Fiction', N'Ended', 60, 60, N'2006-09-25', N'2010-02-08', N'', 0, 91, N'', N'<p>This epic chronicles the lives of ordinary people who discover they possess extraordinary abilities. As a total eclipse casts a shadow across the globe, viewers follow a genetics professor in India whose father''s disappearance leads him to uncover a secret theory<i>—</i>there are people with super powers living among us. A young dreamer tries to convince his politician brother that he can fly. A high school cheerleader learns that she is totally indestructible. A Las Vegas stripper, struggling to make ends meet to support her young son, uncovers that her mirror image has a secret. A prison inmate mysteriously finds himself waking up outside of his cell. A gifted artist, whose drug addiction is destroying his life and the relationship with his girlfriend, can paint the future. A down-on-his-luck beat cop can hear people''s thoughts, including the secrets of a captured terrorist. In Japan, a young man develops a way to stop time through sheer will power. Their ultimate destiny is nothing less than saving the world.</p>', 1615736002, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/1904.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/1904.jpg', N'', N'US', N'United States', N'NBC', N'', N'', N'', 7.7, N'Monday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (136, N'https://www.tvmaze.com/shows/136/the-mccarthys', N'The McCarthys', N'Scripted', N'English', N'Comedy, Family', N'Ended', 30, 30, N'2014-10-30', N'2015-07-11', N'', 0, 47, N'', N'<p><b>The McCarthys</b> is a multi-camera comedy about a close-knit, sports-crazed Boston family whose somewhat athletically challenged son, Ronny, is chosen by his father to be his assistant high school basketball coach, much to the surprise of his more qualified siblings. Ronny wants nothing more than to move away, join the singles scene and find a partner. His distraught mother, Marjorie is not upset that her favorite son is gay, but that he wants to leave Boston and his family.</p><p>Ronny''s plans change, however, when his politically incorrect and outspoken father, Arthur stuns everyone with his choice for an assistant. Touched by his father''s offer, Ronny embarks on a completely different future and he can be sure that his loving family, including his twin brothers Sean and Gerard and his sister Jackie, are going to have a very vocal opinion about it.</p>', 1617705086, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/1900.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/1900.jpg', N'', N'US', N'United States', N'CBS', N'', N'', N'', 6.5, N'Saturday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (137, N'https://www.tvmaze.com/shows/137/cristela', N'Cristela', N'Scripted', N'English', N'Comedy, Legal', N'Ended', 30, 30, N'2014-10-10', N'2015-04-17', N'', 0, 64, N'', N'<p>Cristela''s dream of becoming a lawyer is something her traditional Mexican-American family doesn''t quite understand. She''s entering her sixth year of law school after juggling home obligations and working multiple jobs to pay her way.</p>', 1617705139, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/1932.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/1932.jpg', N'', N'US', N'United States', N'ABC', N'', N'', N'', 7.1, N'Friday', N'20:30', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (138, N'https://www.tvmaze.com/shows/138/the-leftovers', N'The Leftovers', N'Scripted', N'English', N'Drama, Science-Fiction, Thriller', N'Ended', 60, 61, N'2014-06-29', N'2017-06-04', N'http://www.hbo.com/the-leftovers', 0, 95, N'', N'<p>Three years after millions of people—some 2% of the world''s population—vanished into thin air, residents of Mapleton, NY weigh the pros and cons of a "Heroes Day" tribute to the local "Departed". Attempting to maintain a sense of normalcy in his strained community, police chief Kevin Garvey faces additional challenges at home with his daughter, Jill, who''s lost in a cloud of apathy with her friend Aimee, and son, Tom, who has gravitated to a cult led by the charismatic Holy Wayne. Also of concern is a silent, white-clad group of chain-smoking men and women called the Guilty Remnant, who team up in pairs to stake out people and places around town. As tension in Mapleton escalates, the lives of Laurie, an unexpected member of the Guilty Remnant, and Meg, a recently engaged young woman, converge.</p>', 1576743061, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/107/267799.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/107/267799.jpg', N'', N'US', N'United States', N'HBO', N'', N'', N'', 8.2, N'Sunday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (139, N'https://www.tvmaze.com/shows/139/girls', N'Girls', N'Scripted', N'English', N'Drama, Romance', N'Ended', 30, 30, N'2012-04-15', N'2017-04-16', N'http://www.hbo.com/girls', 0, 97, N'', N'<p>This Emmy winning series is a comic look at the assorted humiliations and rare triumphs of a group of girls in their 20s.</p>', 1611310521, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/31/78286.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/31/78286.jpg', N'', N'US', N'United States', N'HBO', N'', N'', N'', 6.6, N'Sunday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (140, N'https://www.tvmaze.com/shows/140/looking', N'Looking', N'Scripted', N'English', N'Drama, Comedy, Romance', N'Ended', 30, 32, N'2014-01-19', N'2015-03-22', N'http://www.hbo.com/looking', 0, 94, N'', N'<p><b>Looking</b> offers up the unfiltered experiences of three close friends living - and loving - in modern-day San Francisco. Friendship may bind them, but each is at a markedly different point in his journey: Patrick is the 29-year-old video game designer getting back into the dating world in the wake of his ex''s engagement; aspiring artist Agustín, 31, is questioning the idea of monogamy amid a move to domesticate with his boyfriend; and the group''s oldest member - longtime waiter Dom, 39 - is facing middle age with romantic and professional dreams still unfulfilled.</p><p>The trio''s stories intertwine and unspool dramatically as they search for happiness and intimacy in an age of unparalleled choices - and rights - for gay men. Also important to the ‘Looking'' mix is the progressive, unpredictable, sexually open culture of the Bay Area, with real San Francisco locations serving as a backdrop for the group''s lives. Rounding out the ‘Looking'' world are a bevy of dynamic gay men including Kevin, Lynn, and Richie, as well as a wide-range of supporting characters like Dom''s roommate Doris, Agustín''s boyfriend Frank, and Patrick''s co-worker Owen.</p>', 1637303442, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/1961.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/1961.jpg', N'', N'US', N'United States', N'HBO', N'', N'', N'', 7.1, N'Sunday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (141, N'https://www.tvmaze.com/shows/141/getting-on', N'Getting On', N'Scripted', N'English', N'Comedy, Medical', N'Ended', 30, 30, N'2013-11-24', N'2015-12-13', N'http://www.hbo.com/getting-on', 0, 48, N'', N'<p>From creators Mark V. Olsen and Will Scheffer, the series follows the daily lives of nurses and doctors as they struggle with the darkly comic realities of caring for the elderly in an overwhelmed healthcare system, skewering the petty bureaucracies of modern medical practice in America.</p>', 1577696647, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/1970.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/1970.jpg', N'', N'US', N'United States', N'HBO', N'', N'', N'', 7.8, N'Sunday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (142, N'https://www.tvmaze.com/shows/142/veep', N'Veep', N'Scripted', N'English', N'Comedy', N'Ended', 30, 30, N'2012-04-22', N'2019-05-12', N'http://www.hbo.com/veep/', 0, 93, N'', N'<p>Former Senator Selina Meyer has accepted the call to serve as Vice President of the United States. The job is nothing like she imagined and everything she was warned about. <b>Veep</b> follows Meyer and her staff as they attempt to make their mark and leave a lasting legacy, without getting tripped up in the day-to-day political games that define Washington.</p>', 1643864911, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/189/472887.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/189/472887.jpg', N'', N'US', N'United States', N'HBO', N'https://www.hbo.com/', N'', N'', 8.1, N'Sunday', N'22:30', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (143, N'https://www.tvmaze.com/shows/143/silicon-valley', N'Silicon Valley', N'Scripted', N'English', N'Comedy', N'Ended', 30, 30, N'2014-04-06', N'2019-12-08', N'http://www.hbo.com/silicon-valley/', 0, 96, N'', N'<p>In the high-tech gold rush of modern Silicon Valley, the people most qualified to succeed are the least capable of handling success. From Mike Judge comes this satire about a programmer whose game-changing algorithm becomes the subject of a valley-wide bidding war.</p>', 1643698751, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/215/538434.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/215/538434.jpg', N'', N'US', N'United States', N'HBO', N'https://www.hbo.com/', N'', N'', 8.5, N'Sunday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (144, N'https://www.tvmaze.com/shows/144/the-comeback', N'The Comeback', N'Scripted', N'English', N'Comedy', N'Ended', 30, 30, N'2005-06-05', N'2014-12-28', N'http://www.hbo.com/the-comeback', 0, 84, N'', N'<p>The limited comedy series stars Lisa Kudrow as the embattled Valerie Cherish, a fading TV "It Girl" who was once so desperate to stay in the spotlight that she allowed cameras to follow her every move as she appeared on a new sitcom - with disastrous results. Now, it''s ten years later, and Valerie thinks she has it all figured out this time. She doesn''t.</p>', 1617705736, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/280/700748.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/280/700748.jpg', N'', N'US', N'United States', N'HBO', N'', N'', N'', 8, N'Sunday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (145, N'https://www.tvmaze.com/shows/145/house-of-lies', N'House of Lies', N'Scripted', N'English', N'Drama, Comedy', N'Ended', 30, 30, N'2012-01-08', N'2016-06-12', N'http://www.sho.com/sho/house-of-lies/home', 0, 86, N'', N'<p>Charming, fast talking Marty Kaan and his crack team of management consultants know how to play the corporate game better than anyone, by using every dirty trick in the book to woo powerful CEOs and close huge deals. In the board rooms, barrooms, and bedrooms of the power elite, corruption is business as usual and everyone''s out for themselves first. Nothing is sacred in this scathing, irreverent satire of corporate America today.</p>', 1603939550, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/2003.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/2003.jpg', N'', N'US', N'United States', N'Showtime', N'', N'', N'', 7.8, N'Sunday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (146, N'https://www.tvmaze.com/shows/146/episodes', N'Episodes', N'Scripted', N'English', N'Comedy', N'Ended', 30, 30, N'2011-01-09', N'2017-10-08', N'http://www.sho.com/sho/episodes/home', 0, 91, N'', N'<p>Matt LeBlanc stars as Matt LeBlanc in <b>Episodes</b>, the hilarious comedy series about remaking a comedy series. When husband and wife writing team Sean and Beverly set out to reproduce their British TV hit for an American network, all of their worst fears come true as Hollywood lives up to its reputation for absurdity. Not only does the network cast Matt LeBlanc in the starring role, but Matt takes the lead in deviously twisting their beloved series into a terrible cliché, while testing the couple''s marriage with diversions and temptations.</p>', 1603939102, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/123/309535.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/123/309535.jpg', N'', N'US', N'United States', N'Showtime', N'', N'', N'', 8, N'Sunday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (147, N'https://www.tvmaze.com/shows/147/nurse-jackie', N'Nurse Jackie', N'Scripted', N'English', N'Drama, Comedy', N'Ended', 30, 30, N'2009-06-08', N'2015-06-28', N'', 0, 86, N'', N'<p>Every day is a matter of life and death in a hectic New York City hospital, but for <b>Nurse Jackie</b> that''s the easiest part. Between chronic back pain that won''t quit, and a personal life on the constant edge of collapse, it''s going to take a white lie here, a bent rule there, and a handful of secret strategies to relieve the pain, and stay one step ahead of total disaster.</p>', 1617707459, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/2021.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/2021.jpg', N'', N'US', N'United States', N'Showtime', N'', N'', N'', 7.8, N'Sunday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (148, N'https://www.tvmaze.com/shows/148/web-therapy', N'Web Therapy', N'Scripted', N'English', N'Comedy', N'Ended', 30, 30, N'2011-07-19', N'2015-01-28', N'', 0, 48, N'', N'<p>Fiona Wallice is a therapist with little patience for her patients. Tired of hearing about people''s problems for fifty long minutes, she devises a new treatment, the three-minute video chat. And still, the sessions end up being largely about her. If she''s your therapist, you''ve got problems. Emmy Award® winner Lisa Kudrow co-created, produces and stars in this outrageous therapeutic send-up. Originally produced as webisodes, <b>Web Therapy</b> features an A-list guest cast who, along with Kudrow, improvise their performances with hilarious results.</p>', 1580596007, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/2036.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/2036.jpg', N'', N'US', N'United States', N'Showtime', N'', N'', N'', 7, N'Wednesday', N'23:00', 0, N'', N'', N'')
