INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (150, N'https://www.tvmaze.com/shows/150/shameless', N'Shameless', N'Scripted', N'English', N'Drama, Comedy, Family', N'Ended', 60, 60, N'2011-01-09', N'2021-04-11', N'http://www.sho.com/sho/shameless/home', 0, 98, N'', N'<p><b>Shameless</b> is a fiercely engaging and fearlessly twisted series. Chicagoan Frank Gallagher is the proud single dad of six smart, industrious, independent kids, who without him would be... perhaps better off. When Frank''s not at the bar spending what little money they have, he''s passed out on the floor. But the kids have found ways to grow up in spite of him. They may not be like any family you know, but they make no apologies for being exactly who they are.</p>', 1634396488, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/284/712350.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/284/712350.jpg', N'', N'US', N'United States', N'Showtime', N'', N'', N'', 8.5, N'Sunday', N'21:00', 0, N'', N'', N'')
