INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (154, N'https://www.tvmaze.com/shows/154/sanctuary', N'Sanctuary', N'Scripted', N'English', N'Drama, Adventure, Science-Fiction', N'Ended', 60, 60, N'2008-10-03', N'2011-12-30', N'', 0, 95, N'', N'<p><b>Sanctuary</b> follows the adventures of the beautiful, enigmatic and always surprising Dr. Helen Magnus, a brilliant scientist who holds the secrets of a clandestine population and a group of strange and sometimes terrifying beings that hide among humans.</p><p>Along with her new recruit, forensic psychiatrist Dr. Will Zimmerman, her quirky tech wiz Henry and her fearless daughter Ashley, Magnus seeks to protect this threatened phenomena as well as unlock the mysteries behind their existence.</p>', 1613075951, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/2119.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/2119.jpg', N'', N'US', N'United States', N'Syfy', N'', N'', N'', 8, N'Friday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (155, N'https://www.tvmaze.com/shows/155/beauty-and-the-beast', N'Beauty and the Beast', N'Scripted', N'English', N'Drama, Horror, Romance', N'Ended', 60, 60, N'2012-10-11', N'2016-09-15', N'http://www.cwtv.com/shows/beauty-and-the-beast', 0, 89, N'', N'<p>Detective Catherine Chandler is a smart, no-nonsense homicide detective. When she was a teenager, she witnessed the murder of her mother at the hands of two gunmen and herself was saved by someone – or something. Years have passed and while investigating a murder, Catherine discovers a clue that leads her to Vincent Keller, who was reportedly killed in 2002. Catherine learns that Vincent is actually still alive and that it was he who saved her many years before. For mysterious reasons that have forced him to live outside of traditional society, Vincent has been in hiding for the past 10 years to guard his secret – when he is enraged, he becomes a terrifying beast, unable to control his super-strength and heightened senses.</p>', 1637410793, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/2128.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/2128.jpg', N'', N'US', N'United States', N'The CW', N'', N'', N'', 7.3, N'Thursday', N'21:00', 0, N'', N'', N'')
