INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (158, N'https://www.tvmaze.com/shows/158/fringe', N'Fringe', N'Scripted', N'English', N'Drama, Action, Science-Fiction', N'Ended', 60, 61, N'2008-09-09', N'2013-01-18', N'', 0, 97, N'', N'<p>When an international flight lands at Boston''s Logan Airport and the passengers and crew have all died grisly deaths, FBI Special Agent Olivia Dunham is called in to investigate. After her partner is nearly killed during the investigation, a desperate Olivia searches frantically for someone to help, leading her to Dr. Walter Bishop, our generation''s Einstein. There''s only one catch: he''s been institutionalized for the last twenty years, and the only way to question him requires pulling his estranged son Peter in to help. When Olivia''s investigation leads her to a manipulative corporate executive, she and her team will discover that what happened on Flight 627 is only a small piece of a larger, more shocking truth and will explore the blurring line between the possible and the impossible.</p>', 1632962011, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/2245.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/2245.jpg', N'', N'US', N'United States', N'FOX', N'', N'', N'', 8.8, N'Friday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (159, N'https://www.tvmaze.com/shows/159/state-of-affairs', N'State of Affairs', N'Scripted', N'English', N'Drama, Thriller', N'Ended', 60, 60, N'2014-11-17', N'2015-02-16', N'', 0, 65, N'', N'<p>Each day the President is faced with dozens of life and death decisions, and to prioritize the biggest international crises facing the country, one top CIA analyst — Charleston Tucker — assembles the President''s Daily Briefing (PDB). This list of the most vital security issues facing the nation brings with it moral and political judgment calls for Charleston and... her trusted group of brilliant analysts at the agency. Aside from the political minefields she has to walk, Charlie has a close personal relationship with the President because she was once engaged to her son before a tragic terrorist attack took his life. Charlie survived that attack and is now determined to bring the perpetrators to justice. Navigating a complex personal life and a pressure-cooker profession is, of course, a challenge, and Charlie sometimes engages in boundary-pushing behavior to avoid facing her grief. But when the clock strikes 2 a.m., she is all about her job — protecting her nation, serving her President and still trying to get to the bottom of her fiancé''s murder that will reveal itself as a shocking mystery.</p>', 1617710720, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/280/700731.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/280/700731.jpg',