INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (166, N'https://www.tvmaze.com/shows/166/battlestar-galactica', N'Battlestar Galactica', N'Scripted', N'English', N'Drama, Science-Fiction, War', N'Ended', 60, 61, N'2003-12-08', N'2010-01-10', N'http://www.syfy.com/battlestargalactica', 0, 97, N'', N'<p>The world ended with no warning, and all that was left… was hope.</p><p>A truce between the humans of the Twelve Colonies and the Cylons—intelligent robots designed by humankind—lasts for 40 tense and silent years. <b>Battlestar Galactica</b> picks up just as the Cylons commit mass genocide against humanity. Only the Battlestar Galactica (an old warship about to be decommissioned and turned into a museum) and those souls fortunate enough to be aboard other starships were able to survive the attack. In the aftermath, the Galactica''s commanding officer, William Adama, finds himself responsible for safeguarding the last remnants of the human race—fewer than 50,000 desperate survivors. Meanwhile, the annihilation of the Colonial government results in the succession of the Secretary of Education, Laura Roslin, to the presidency. Driven by prophetic visions and political necessity, the Galactica travels through uncharted space in hopes of finding the mythical, lost 13th colony—Earth.</p>', 1641924420, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/2313.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/2313.jpg', N'', N'US', N'United States', N'Syfy', N'', N'', N'', 8.9, N'Friday', N'22:00', 0, N'', N'', N'')
