INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (168, N'https://www.tvmaze.com/shows/168/chuck', N'Chuck', N'Scripted', N'English', N'Drama, Comedy, Action', N'Ended', 60, 60, N'2007-09-24', N'2012-01-27', N'http://www.nbc.com/chuck', 0, 97, N'', N'<p><b>Chuck</b> Bartowski is a computer geek that gets catapulted into a new career as the government''s most vital secret agent. When Chuck opens an e-mail subliminally encoded with government secrets, he unwittingly downloads an entire server of sensitive data into his brain. With the government''s most precious secrets in Chuck''s head, Major John Casey of the National Security Agency assumes the responsibility of protecting him. His partner is the CIA''s top agent, Sarah Walker.</p>', 1592096379, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/2385.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/2385.jpg', N'', N'US', N'United States', N'NBC', N'', N'', N'', 8.5, N'Friday', N'20:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (169, N'https://www.tvmaze.com/shows/169/breaking-bad', N'Breaking Bad', N'Scripted', N'English', N'Drama, Crime, Thriller', N'Ended', 60, 60, N'2008-01-20', N'2019-10-11', N'http://www.amc.com/shows/breaking-bad', 0, 97, N'', N'<p><b>Breaking Bad</b> follows protagonist Walter White, a chemistry teacher who lives in New Mexico with his wife and teenage son who has cerebral palsy. White is diagnosed with Stage III cancer and given a prognosis of two years left to live. With a new sense of fearlessness based on his medical prognosis, and a desire to secure his family''s financial security, White chooses to enter a dangerous world of drugs and crime and ascends to power in this world. The series explores how a fatal diagnosis such as White''s releases a typical man from the daily concerns and constraints of normal society and follows his transformation from mild family man to a kingpin of the drug trade.</p>', 1610551143, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/0/2400.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/0/2400.jpg', N'', N'US', N'United States', N'AMC', N'', N'', N'', 9.2, N'Sunday', N'22:00', 0, N'', N'', N'')
