INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (175, N'https://www.tvmaze.com/shows/175/house-of-cards', N'House of Cards', N'Scripted', N'English', N'Drama, Thriller', N'Ended', 0, 52, N'2013-02-01', N'2018-11-02', N'https://www.netflix.com/title/70178217', 0, 97, N'', N'<p>Based on the BBC miniseries of the same name, <b>House of Cards</b> follows Francis Underwood, the politician''s politician – masterful, beguiling, charismatic and ruthless. He and his equally ambitious wife Claire will stop at nothing to ensure their ascendancy. This wicked political drama slithers beneath the curtain and through the back halls of greed, sex, love and corruption in modern Washington D.C.</p>', 1619846979, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/169/424482.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/169/424482.jpg', N'', N'', N'', N'', N'', N'', N'', 8.4, N'', N'', 0, N'', N'', N'Netflix')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (176, N'https://www.tvmaze.com/shows/176/teen-wolf', N'Teen Wolf', N'Scripted', N'English', N'Drama, Romance, Supernatural', N'Ended', 60, 60, N'2011-06-05', N'2017-09-24', N'http://www.mtv.com/shows/teen-wolf', 0, 96, N'', N'<p>Always an outsider and often unnoticed, Scott McCall yearns to be recognized in some small way that takes him out of his typical state of high school anonymity. When his best friend, Stiles, convinces him to go into the woods one night to join a police search for a dead body, Scott encounters a creature in the darkness. Narrowly escaping an attack with a vicious bite in his side, the next day brings strange surprises for Scott at school and his life will never be the same.</p><p>MTV''s reboot of the classic 1980s cult movie <b>Teen Wolf</b>.</p>', 1637837883, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/30/75365.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/30/75365.jpg', N'', N'US', N'United States', N'MTV', N'', N'', N'', 8.2, N'Sunday', N'20:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (177, N'https://www.tvmaze.com/shows/177/pretty-little-liars', N'Pretty Little Liars', N'Scripted', N'English', N'Romance, Thriller, Mystery', N'Ended', 60, 60, N'2010-06-08', N'2017-06-27', N'http://freeform.go.com/shows/pretty-little-liars', 0, 98, N'', N'<p>Rosewood is a perfect little town. So quiet and pristine, you''d never guess it holds so many secrets. Some of the ugliest ones belong to the prettiest girls in town: Aria, Spencer, Hanna and Emily, four friends whose darkest secrets have been unraveling since Alison, the Queen Bee of their group disappeared. As the mystery surrounding Ali''s disappearance resurfaces, the girls begin getting messages from a mysterious "A," who they quickly realize is out to get them. Now, after years of tormenting and numerous shocking revelations, the Liars are united and ready to kick some "A" and uncover the truth! No longer just wanting to sit by and wait for "A''s" latest cruel attack, Aria, Emily, Hanna and Spencer take matters into their own hands and try to finally put a stop to their tormentor. As relationships are put to the test, new and old secrets are revealed and the stakes are raised higher than ever before as the Liars come closer to the truth. Will all of their sacrifices be worth it in the end?</p>', 1642255090, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/125/314775.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/125/314775.jpg', N'', N'US', N'United States', N'FreeForm', N'', N'', N'', 7.5, N'Tuesday', N'20:00', 0, N'', N'', N'')
