INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (179, N'https://www.tvmaze.com/shows/179/the-wire', N'The Wire', N'Scripted', N'English', N'Drama, Crime', N'Ended', 60, 60, N'2002-06-02', N'2008-03-09', N'http://www.hbo.com/the-wire', 0, 97, N'', N'<p>The first season of <b>The Wire</b> (2002) concentrated on the often-futile efforts of police to infiltrate a West Baltimore drug ring headed by Avon Barksdale and his lieutenant, Stringer Bell. In Seasons Two and Three, as the Barksdale investigation escalated, new storylines involving pressures on the working class and the city''s political leadership were introduced. Season Four focused on the stories of several young boys in the public school system, struggling with problems at home and the lure of the corner - set against the rise of a new drug empire in West Baltimore and a new Mayor in City Hall. The fifth and final season of <i>The Wire</i> centers on the media''s role in addressing - or failing to address - the fundamental political, economic and social realities depicted over the course of the series, while also resolving storylines of the numerous characters woven throughout the narrative arc of the show.</p>', 1631290753, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/2527.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/2527.jpg', N'', N'US', N'United States', N'HBO', N'', N'', N'', 9.1, N'Sunday', N'21:00', 0, N'', N'', N'')
