INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (182, N'https://www.tvmaze.com/shows/182/black-sails', N'Black Sails', N'Scripted', N'English', N'Drama, Action, Adventure', N'Ended', 60, 60, N'2014-01-25', N'2017-04-02', N'http://www.starz.com/originals/blacksails', 0, 96, N'', N'<p>1715. The Golden Age of Piracy. New Providence Island is a lawless territory, controlled by history''s most notorious pirate captains. The most feared is Captain Flint.</p><p>As the British Navy returns to redeem their land and exterminate Flint and his crew, another side of him emerges. Captain Flint aligns himself with Eleanor Guthrie, daughter of the local kingpin, to hunt the ultimate prize and ensure their survival.</p><p>Many opponents stand in their way: rival captains, jealous of Flint''s power; Eleanor''s ambitious and intrusive father; and a young sailor recently recruited onto Flint''s crew, John Silver, who constantly undermines his captain''s agenda.</p>', 1636922318, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/78/195951.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/78/195951.jpg', N'', N'US', N'United States', N'STARZ', N'', N'', N'', 8.5, N'Sunday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (183, N'https://www.tvmaze.com/shows/183/tyrant', N'Tyrant', N'Scripted', N'English', N'Drama, Thriller', N'Ended', 60, 64, N'2014-06-24', N'2016-09-07', N'http://www.fxnetworks.com/tyrant', 0, 50, N'', N'<p><b>Tyrant</b> is a drama that follows a typical American family whose members find themselves embroiled in the geopolitical intrigue of a volatile Middle Eastern country. Barry Al-Fayeed is a California pediatrician who also happens to be the second son of a Middle Eastern dictator. Barry reluctantly agrees to return home with his American family for his nephew''s wedding. Events thrust him into the complex and turbulent growing pains of a nation straining to break free from dictatorial rule.</p>', 1577610614, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/2649.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/2649.jpg', N'', N'US', N'United States', N'FX', N'', N'', N'', 7.9, N'Wednesday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (184, N'https://www.tvmaze.com/shows/184/bojack-horseman', N'BoJack Horseman', N'Animation', N'English', N'Drama, Comedy', N'Ended', 25, 26, N'2014-08-22', N'2020-01-31', N'https://www.netflix.com/title/70300800', 0, 95, N'', N'<p>Meet the most beloved sitcom horse of the ''90s, 20 years later. He''s a curmudgeon with a heart of... not quite gold... but something like gold. Copper?</p>', 1631643074, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/236/590384.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/236/590384.jpg', N'', N'', N'', N'', N'', N'', N'', 8.1, N'', N'', 0, N'', N'', N'Netflix')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (185, N'https://www.tvmaze.com/shows/185/salem', N'Salem', N'Scripted', N'English', N'Drama, Thriller, Supernatural', N'Ended', 60, 60, N'2014-04-20', N'2017-01-25', N'http://www.wgnamerica.com/series/salem', 0, 93, N'', N'<p>Set in 17th century colonial Massachusetts—a significant time in the history of American politics, religion and society— <b>Salem</b> brings you the real story behind the infamous witch trials. In Salem, witches are real, and they''re behind it all. Salem Village and Salem Town feuded over property, grazing rights and church rights. The government was dominated by Puritan leaders. People were scrutinized closely and this resulted in obvious discord. They were afraid of being persecuted for anything that may offend the Puritan mindset. The word "witch" seemed an easy and appropriate curse hurled at someone who behaved abnormally.</p>', 1573603472, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/73/184895.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/73/184895.jpg', N'', N'US', N'United States', N'WGN America', N'', N'', N'', 7.2, N'Wednesday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (186, N'https://www.tvmaze.com/shows/186/turn-washingtons-spies', N'TURN: Washington''s Spies', N'Scripted', N'English', N'Drama, War', N'Ended', 60, 60, N'2014-04-06', N'2017-08-12', N'https://www.amc.com/shows/turn-2--122', 0, 88, N'', N'<p><b>Turn: Washington''s Spies</b> takes viewers into the stirring and treacherous world of the Revolutionary War and introduces Abraham Woodhull who, after aligning with a group of childhood friends, forms the Culper Ring--America''s first spy ring.</p>', 1631237606, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/356/890242.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/356/890242.jpg', N'', N'US', N'United States', N'AMC', N'', N'', N'', 8.2, N'Saturday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (187, N'https://www.tvmaze.com/shows/187/intelligence', N'Intelligence', N'Scripted', N'English', N'Action, Science-Fiction', N'Ended', 60, 60, N'2014-01-07', N'2014-03-31', N'', 0, 95, N'', N'<p><b>Intelligence</b> is a dramatic thriller about a high-tech intelligence operative enhanced with a super-computer microchip in his brain. With this implant, Gabriel Vaughn is the first human ever to be connected directly into the worldwide information grid and have complete access to Internet, WiFi, telephone and satellite data. He can hack into any data center and access key Intel in the fight to protect the United States from its enemies. Leading the elite government cyber-security agency created to support him is Director Lillian Strand, a straightforward and efficient boss who oversees the unit''s missions. Strand assigns Riley Neal, a Secret Service agent, to protect Gabriel from outside threats, as well as from his appetite for reckless, unpredictable behavior and disregard for protocol. Other skilled members of the Cybercom team include Chris Jameson and Gonzalo "Gonzo" Rodriguez two resourceful federal investigators. The brains behind the design of the chip is Dr. Shenendoah Cassidy, whose son, Nelson is jealous of Gabriel''s prominent place in his father''s life. As the first supercomputer with a beating heart, Gabriel is the most valuable piece of technology the country has ever created and is the U.S.''s secret weapon.</p>', 1589547362, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/2715.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/2715.jpg', N'', N'US', N'United States', N'CBS', N'', N'', N'', 6.8, N'Monday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (188, N'https://www.tvmaze.com/shows/188/believe', N'Believe', N'Scripted', N'English', N'Drama, Action, Fantasy', N'Ended', 60, 59, N'2014-03-10', N'2014-06-30', N'', 0, 74, N'', N'<p>Levitation, telekinesis, the ability to control nature and even predict the future... Since she was 2 years old, Bo has had gifts she could neither fully understand, nor control. Raised by a small group known as the "True Believers," the orphaned girl has been safeguarded from harmful outsiders who would use her forces for personal gain. But now that she is 10, her powers have become stronger and the threat has grown more dangerous. With her life and future now in jeopardy, the "Believers" turn to the only person they see fit to be her full-time protector. That is, once they break him out of jail. Tate, a wrongfully imprisoned death row inmate who''s lost his will, is initially reluctant until he witnesses one of her extraordinary abilities. Bo sees people for who they truly are... and who they may become. Tate and Bo begin their journey, one in which trust must be earned. Traveling from city to city, every place they stop and everyone they meet will be changed forever. But they''ll have to keep going to stay one step ahead of the sinister forces after Bo''s power... because it will take a miracle to keep them safe forever.</p>', 1617711427, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/51/127824.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/51/127824.jpg', N'', N'US', N'United States', N'NBC', N'', N'', N'', 7.4, N'Sunday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (189, N'https://www.tvmaze.com/shows/189/star-crossed', N'Star-Crossed', N'Scripted', N'English', N'Drama, Romance, Science-Fiction', N'Ended', 60, 60, N'2014-02-17', N'2014-05-12', N'http://www.cwtv.com/shows/star-crossed/', 0, 98, N'', N'<p>When Emery was 6 years old, an alien spacecraft crash-landed in her small town. Whether they came in peace or with more sinister intentions didn''t matter: a fierce battle erupted as humans fought for control over their new rivals, an alien species called the Atrians. In the midst of the conflict, Roman, a 6-year-old Atrian boy, found his way to a shed behind Emery''s house, where she protected him from harm, bringing him food, comfort - and friendship. In their brief time together, Emery and Roman forged a deep bond, but the authorities wasted no time tracking Roman down and capturing him in a violent confrontation. Emery has grown up believing that Roman was killed that day. Ten years later, the Atrians have been acclimated to life on Earth, but they are interned in a heavily-guarded camp known as the Sector to keep them separate from humans. Now, for the first time, a group of Atrian teens will enroll in a suburban human high school, with the goal of testing the feasibility of human/alien integration. The eyes of the nation and the whole world are fixed on this historical social experiment, an endeavor fraught with suspicion and fear. In the mayhem of the first day, Emery is amazed to learn that Roman was not killed by the authorities and is, in fact, one of the Atrian students. Their childhood bond is quickly rekindled - in a school and a society that distrusts everything about the Atrians, Emery and Roman have found each other again. However, their relationship is threatened by the small-mindedness of their respective communities and the political agendas of people in power. While the world around them rages with anger and prejudice, their bond becomes increasingly strong and increasingly dangerous. As an epic Romeo and Juliet romance unfolds, a violent encounter between Roman''s father and Emery''s father occurs in the Sector. Can Roman and Emery''s love - and peace between the species - survive?</p>', 1636967244, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/2776.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/2776.jpg', N'', N'US', N'United States', N'The CW', N'', N'', N'', 6.8, N'Monday', N'20:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (190, N'https://www.tvmaze.com/shows/190/crisis', N'Crisis', N'Scripted', N'English', N'Drama, Action, Thriller', N'Ended', 60, 60, N'2014-03-16', N'2014-06-21', N'http://www.nbc.com/crisis/', 0, 63, N'', N'<p>It''s field trip day for the students of Ballard High School, a place that educates the children of Washington, D.C.''s elite, top-of-their-industry CEOs, international diplomats, political power players and even the president''s son. But when their bus is ambushed on a secluded rural road, the teenagers and their chaperones are taken, igniting a national crisis. Now with some of the country''s most powerful parents at the mercy of one vengeful mastermind, the question arises: How far would you go and what would you become to ensure your child''s safe return? With so many parents and dignitaries put into play with nowhere to turn and no one to trust, this unthinkable scenario grows from the select families at risk to an entire nation at stake.</p>', 1600125979, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/2786.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/2786.jpg', N'', N'US', N'United States', N'NBC', N'', N'', N'', 7.1, N'Sunday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (191, N'https://www.tvmaze.com/shows/191/halt-and-catch-fire', N'Halt and Catch Fire', N'Scripted', N'English', N'Drama', N'Ended', 60, 60, N'2014-06-01', N'2017-10-14', N'http://www.amc.com/shows/halt-and-catch-fire', 0, 92, N'', N'<p><b>Halt and Catch Fire</b> is set roughly one year after IBM all but corners the market with the release of its first major product – the IBM PC. In this fictional drama, a former IBM executive, Joe MacMillan plans to reverse engineer the flagship product of his former employer and forces his current company, Cardiff Electric, into the personal computer race. MacMillan enlists the help of Gordon Clark, a great engineer whose unrealized dreams of creating a revolutionary product have created tension in his marriage to Donna, and Cameron Howe, a volatile prodigy who puts her future in jeopardy to join MacMillan''s rogue PC project. Halt and Catch Fire thrives on the spirit of innovation and explores what it''s like to stand at the forefront of something world-changing and work towards it, no matter the risk.</p>', 1644190243, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/2798.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/2798.jpg', N'', N'US', N'United States', N'AMC', N'', N'', N'', 8.3, N'Saturday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (192, N'https://www.tvmaze.com/shows/192/hello-ladies', N'Hello Ladies', N'Scripted', N'English', N'Comedy', N'Ended', 30, 30, N'2013-09-29', N'2013-11-17', N'http://www.hbo.com/hello-ladies', 0, 73, N'', N'<p>Stewart is a gawky, 6'' 7" Englishman searching for the woman of his dreams in Los Angeles. Half as charming - and twice as desperate - as he thinks he is, he''s obsessed with infiltrating the glamorous world of beautiful people, who won''t let him in.</p>', 1617568146, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/2826.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/2826.jpg', N'', N'US', N'United States', N'HBO', N'', N'', N'', 6.4, N'Sunday', N'22:30', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (193, N'https://www.tvmaze.com/shows/193/dads', N'Dads', N'Scripted', N'English', N'Comedy', N'Ended', 30, 30, N'2013-09-17', N'2014-02-11', N'', 0, 48, N'', N'<p>Honor thy father. Way easier said than done. Especially when your dad''s broke, living in your house and ruining your life. <b>Dads</b> explores the often treacherous terrain of the father-son landscape. This series follows two successful guys - and childhood best friends - now in their mid-30s whose relatively stable lives get turned upside down when their pain-in-the-neck patriarchs move in.</p>', 1558245666, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/2831.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/2831.jpg', N'', N'US', N'United States', N'FOX', N'', N'', N'', 5.2, N'Tuesday', N'20:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (194, N'https://www.tvmaze.com/shows/194/hannibal', N'Hannibal', N'Scripted', N'English', N'Drama, Crime, Horror', N'Ended', 60, 60, N'2013-04-04', N'2015-08-29', N'http://www.nbc.com/hannibal', 0, 81, N'', N'<p>Criminal profiler Will Graham is tasked by FBI agent Jack Crawford, the head of Behavioral Sciences, to help investigate the disappearances of eight young girls across Minnesota. Graham and Crawford''s team investigate several subsequent murders, while also trying to catch the Chesapeake Ripper. With the investigation weighing heavily on Graham, Crawford decides to have him supervised by psychiatrist Dr. Hannibal Lecter, who, unbeknownst to them, is the Chesapeake Ripper himself, actively seeking to derail the investigation.</p>', 1631127409, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/160/401855.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/160/401855.jpg', N'', N'US', N'United States', N'NBC', N'', N'', N'', 8.4, N'Thursday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (195, N'https://www.tvmaze.com/shows/195/bates-motel', N'Bates Motel', N'Scripted', N'English', N'Drama, Horror, Thriller', N'Ended', 60, 60, N'2013-03-18', N'2017-04-24', N'http://www.aetv.com/shows/bates-motel', 0, 89, N'', N'<p><b>Bates Motel</b> is a contemporary prequel to the genre-defining film Psycho, and gives viewers an intimate portrayal of how Norman Bates'' psyche unravels through his teenage years.</p><p>Following the tragic death of her husband, Norma Bates buys a motel on the outskirts of the idyllic coastal town of White Pine Bay, seeking a fresh start. As Norma and Norman get ensconced in their new home, they discover this town isn''t quite what it seems, and the locals aren''t so quick to let them in on their secrets. But the Bates'' are done being pushed around and will do whatever it takes to survive - and will do whatever it takes to protect their own secrets.</p>', 1637704995, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/177/444429.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/177/444429.jpg', N'', N'US', N'United States', N'A&E', N'', N'', N'', 8, N'Monday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (196, N'https://www.tvmaze.com/shows/196/the-following', N'The Following', N'Scripted', N'English', N'Drama, Crime, Thriller', N'Ended', 60, 60, N'2013-01-21', N'2015-05-18', N'', 0, 95, N'', N'<p>The FBI estimates there are currently over 300 active serial killers in the United States. What would happen if these killers had a way of communicating and connecting with each other? What if they were able to work together and form alliances across the country? What if one brilliant psychotic serial killer was able to bring them all together and activate a following? Welcome to <b>The Following</b>, a terrifying new thriller.</p>', 1625761171, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/2868.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/2868.jpg', N'', N'US', N'United States', N'FOX', N'', N'', N'', 7, N'Monday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (197, N'https://www.tvmaze.com/shows/197/da-vincis-demons', N'Da Vinci''s Demons', N'Scripted', N'English', N'Drama, Horror', N'Ended', 60, 60, N'2013-04-12', N'2015-10-24', N'http://www.starz.com/originals/davincisdemons/featured', 0, 97, N'', N'<p>In a world where thought and faith are controlled, one man fights to set knowledge free. Leonardo da Vinci is tortured by a gift of superhuman genius. He finds himself in a conflict between truth and lies, religion and reason, past and future. His aspirations are used against him by opposing forces – luring him into a game of seduction where those who despise his intellect need him most.</p><p>His quest for knowledge nearly becomes his undoing, but da Vinci''s genius prevails and he emerges as an unstoppable force that lifts an entire era out of darkness and propels it into light. His story becomes a mirror into our own world, calling us all to join his fight to free the future.</p>', 1579816582, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/2892.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/2892.jpg', N'', N'', N'', N'', N'', N'', N'', 8.1, N'Saturday', N'', 0, N'', N'', N'Starz Play')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (198, N'https://www.tvmaze.com/shows/198/the-fosters', N'The Fosters', N'Scripted', N'English', N'Drama, Family, Romance', N'Ended', 60, 60, N'2013-06-03', N'2018-06-06', N'http://freeform.go.com/shows/the-fosters', 0, 89, N'', N'<p><b>The Fosters</b> is a critically-acclaimed series that centers on biracial lesbian couple Stef and Lena Foster, who are raising a multi-ethnic family mix of foster and biological kids. The second season will continue to explore the growing Fosters clan, with all the triumphs and travails, twists and turns, that fans of the series have come to expect. Callie and Jude will try to adjust to their new roles in the family, and everyone will deal with the fallout from their previous actions. Past mistakes will come home to roost, consequences will be handed out, and victories will be hard fought, and ultimately well-won. Their deep bonds will grow, enabling America''s most modern family to face the future head on, with love in their hearts.</p>', 1644270371, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/116/292055.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/116/292055.jpg', N'', N'US', N'United States', N'FreeForm', N'https://www.freeform.com/', N'', N'', 7.8, N'Tuesday', N'20:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (199, N'https://www.tvmaze.com/shows/199/mistresses', N'Mistresses', N'Scripted', N'English', N'Drama, Romance', N'Ended', 60, 60, N'2013-06-03', N'2016-09-06', N'http://abc.go.com/shows/mistresses', 0, 49, N'', N'<p>Based on the hit UK television series of the same name, <b>Mistresses</b> is a provocative and thrilling drama about the scandalous lives of a sexy and sassy group of four girlfriends, each on her own path to self-discovery. These four friends find support and guidance with each other as they brave their turbulent journeys and life''s storms of excitement, secrecy and betrayal, all the while bound by the complex relationships they''ve created.</p>', 1617574208, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/2950.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/2950.jpg', N'', N'US', N'United States', N'ABC', N'', N'', N'', 7.8, N'Thursday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (200, N'https://www.tvmaze.com/shows/200/the-tomorrow-people', N'The Tomorrow People', N'Scripted', N'English', N'Action, Science-Fiction', N'Ended', 60, 60, N'2013-10-09', N'2014-05-05', N'', 0, 74, N'', N'<p>They are the next evolutionary leap of mankind, a generation of humans born with paranormal abilities - <b>The Tomorrow People</b>. Stephen Jameson stands at the crossroads between the world we know and the shifting world of the future. Up until a year ago, Stephen was a "normal" teenager - until he began hearing voices and teleporting in his sleep, never knowing where he might wake up. Now, Stephen''s issues have gone far beyond the usual teenage angst, and he is beginning to question his sanity. In desperation, Stephen decides to listen to one of the voices in his head, and it leads him to his first encounter with the Tomorrow People - John, Cara and Russell - a genetically advanced race with the abilities of telekinesis, teleportation and telepathic communication. The Tomorrow People are being hunted down by a paramilitary group of scientists known as Ultra. Led by Dr. Jedikiah Price, Ultra sees the Tomorrow People as a very real existential threat from a rival species, and the outcast group has been forced to hide out in an abandoned subway station just beneath the surface of the human world. Trading in secrets, Jedikiah offers Stephen the chance for a normal life with his family and best friend, Astrid, if he will help in the struggle to isolate and eradicate the Tomorrow People. On the other hand, Cara, John and Russell offer Stephen a different type of family and a home where he truly belongs. Unwilling to turn his back on humanity or the world of the Tomorrow People, Stephen sets out on his own path - a journey that could take him into the shadowy past to uncover the truth about his father''s mysterious disappearance, or into an unknown future with The Tomorrow People.</p>', 1573685452, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/55/138044.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/55/138044.jpg', N'', N'US', N'United States', N'The CW', N'', N'', N'', 7.3, N'Monday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (201, N'https://www.tvmaze.com/shows/201/devious-maids', N'Devious Maids', N'Scripted', N'English', N'Drama, Crime', N'Ended', 60, 60, N'2013-06-23', N'2016-08-08', N'http://www.mylifetime.com/shows/devious-maids', 0, 63, N'', N'<p><b>Devious Maids</b> is set in a world where murder and mayhem collide in the mansions of Beverly Hills'' wealthiest and most powerful families. Class warfare has never been as fun and dirty as it is in the tiny enclave where the staff is as clever, witty and downright devilish as their employers. The series centers on a close-knit group of maids, Marisol, Rosie, Carmen Valentina and Zoila, who are bonded together by their jobs, life struggles and the melodramatic universe that engulfs their employers.</p>', 1606657685, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/3005.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/3005.jpg', N'', N'US', N'United States', N'Lifetime', N'', N'', N'', 7.9, N'Monday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (202, N'https://www.tvmaze.com/shows/202/almost-human', N'Almost Human', N'Scripted', N'English', N'Drama, Crime, Science-Fiction', N'Ended', 60, 60, N'2013-11-17', N'2014-03-03', N'', 0, 95, N'', N'<p><b>Almost Human</b> is an action-packed police drama set 35 years in the future, when police officers are partnered with highly evolved human-like androids. The year is 2048. Meet John Kennex a cop who survived one of the most catastrophic attacks ever made against the police department. After waking up from a 17-month coma, he can''t remember much - except that his partner was killed; his girlfriend, Anna Moore, left him after the attack; and he lost one of his legs and is now outfitted with a highly sophisticated synthetic appendage. Suffering from depression, mental atrophy, trauma-onset OCD, PTSD and the "psychological rejection of his synthetic body part," John returns to work at the behest of longtime ally Captain Sandra Maldonado. By mandate, every cop must partner with a robot. And despite his passionate aversion to androids, John is paired up with a battle-ready MX-43. But he abruptly terminates his partnership after the robot discovers incriminating information about him. So technician Rudy Lom introduces John to Dorian, a discontinued android with unexpected emotional responses. Although such responses were deemed flaws, it is in these "flaws" that John relates to Dorian most. After all, John is part-machine now, and Dorian is part-human. John and Dorian''s understanding of each other not only complements them, it connects them. As he adjusts to working with his new partner, John also must learn to get along with his new colleagues, including the eager and somewhat starstruck Detective Valerie Stahl and the distrustful Detective Richard Paul, who does not welcome John back with open arms. Almost Human will follow the week-to-week missions of John and Dorian, as they fight crime across this futuristic landscape, while the mysteries surrounding his attack and the larger mythology of this new world unfold.</p>', 1625857334, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/3020.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/3020.jpg', N'', N'US', N'United States', N'FOX', N'', N'', N'', 7.8, N'Monday', N'20:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (203, N'https://www.tvmaze.com/shows/203/the-carrie-diaries', N'The Carrie Diaries', N'Scripted', N'English', N'Drama, Comedy', N'Ended', 60, 60, N'2013-01-14', N'2014-01-31', N'', 0, 48, N'', N'<p>It''s the summer of 1985, and, for the first time, 17-year-old Carrie Bradshaw can call Manhattan home. After her boyfriend Sebastian and best friend Maggie betrayed her, Carrie is happy to accept the offer to spend the summer living in the downtown loft apartment of her Interview magazine boss Larissa But as summer turns to fall and Carrie heads into her senior year, she and her friends and family discover that letting go of old loves and embracing new dreams comes with some tough new realities but also incredible new opportunities.</p>', 1617712315, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/3037.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/3037.jpg', N'', N'US', N'United States', N'The CW', N'', N'', N'', 6.3, N'Friday', N'20:00', 0, N'', N'', N'')
