INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (208, N'https://www.tvmaze.com/shows/208/the-chair', N'The Chair', N'Reality', N'English', N'', N'Ended', 60, 60, N'2014-09-06', N'2014-11-08', N'', 0, 36, N'', N'<p><b>The Chair</b> is a competition documentary series that follows two directors through the process of bringing their first feature to the screen. The up-and-coming directors, who have unique backgrounds and skill sets, will be provided with an identical screenplay which they must craft as their own film. <i>The Chair</i> will document the creation, marketing and theatrical release of both adaptations, which will also air on STARZ. Both directors will be given the same budget, and both versions will use locations in the same city. Through multiplatform voting, the audience will determine which director will be awarded $250,000.</p>', 1617723262, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/3167.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/3167.jpg', N'', N'US', N'United States', N'STARZ', N'', N'', N'', 0, N'Saturday', N'22:00', 0, N'', N'', N'')
