INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (215, N'https://www.tvmaze.com/shows/215/american-dad', N'American Dad!', N'Animation', N'English', N'Comedy, Family', N'Running', 30, 30, N'2005-02-06', N'', N'http://www.tbs.com/shows/american-dad.html', 0, 99, N'{"name":"United States","code":"US","timezone":"America/New_York"}', N'<p>In <b>American Dad!</b>, Stan Smith leads the all-American family in this animated sitcom filled with wild and crazy extremes. Everyday life is taken to the limit as Stan applies the same drastic measures used in his job at the CIA to his home life. Driven by machismo and the American dream, he often is blind to how horribly he fails at his attempts. This father might not know best, but he never stops trying.</p>', 1644336825, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/389/973823.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/389/973823.jpg', N'', N'US', N'United States', N'TBS', N'', N'', N'', 7.4, N'Monday', N'22:00', 0, N'', N'', N'')
