INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (222, N'https://www.tvmaze.com/shows/222/happyland', N'Happyland', N'Scripted', N'English', N'Drama, Comedy', N'Ended', 30, 60, N'2014-09-30', N'2014-11-18', N'', 0, 46, N'', N'<p><b>Happyland</b> is a soapy teen dramedy exploring the underbelly of one of the country''s most popular theme parks, going behind the scenes to reveal the not so magical reality of the park workers. The series centers on Lucy, the cynical teenage daughter of idealistic park princess mom, Elena. Having grown up in a world of manufactured happiness, Lucy wants to get out and experience something real. When Ian, the new park owner''s son, arrives and sweeps her off her feet, Lucy is left wondering if fairy tale endings do exist after all. But when a scandalous secret turns her life upside down, she learns Happyland is far from a walk in the park.</p>', 1617725566, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/3681.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/3681.jpg', N'', N'US', N'United States', N'MTV', N'', N'', N'', 8, N'Tuesday', N'23:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (224, N'https://www.tvmaze.com/shows/224/twisted', N'Twisted', N'Scripted', N'English', N'Drama, Thriller, Mystery', N'Ended', 60, 60, N'2013-03-19', N'2014-04-01', N'http://abcfamily.go.com/shows/twisted', 0, 69, N'', N'<p>A one-hour mystery full of twists and turns that follows Danny Desai, a charismatic 16-year-old with a troubled past who returns to his hometown after spending five years in juvenile detention. Immediately branded an outcast, Danny attempts to reconnect with his two childhood best friends, Jo and Lacey. But when a fellow student is found dead in her home, Danny instantly becomes the prime suspect and town spirals into a frenzy of suspicion and mystery. Jo and Lacey must decide if their childhood friend is unforgivable, or if he''s really a victim being persecuted for his own twisted secrets.</p>', 1617636305, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/3692.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/3692.jpg', N'', N'US', N'United States', N'FreeForm', N'', N'', N'', 7.4, N'Tuesday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (225, N'https://www.tvmaze.com/shows/225/ravenswood', N'Ravenswood', N'Scripted', N'English', N'Drama, Horror', N'Ended', 60, 60, N'2013-10-22', N'2014-02-04', N'', 0, 80, N'', N'<p><b>Ravenswood</b> centered on a town not far from Rosewood, Pa., which has suffered under a deadly curse for generations. Five strangers find themselves connected by this fatal curse and need to dig into the town''s mysterious and terrible history before it''s too late for all of them.</p>', 1632202479, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/3700.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/3700.jpg', N'', N'US', N'United States', N'FreeForm', N'', N'', N'', 7.1, N'Tuesday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (226, N'https://www.tvmaze.com/shows/226/the-crazy-ones', N'The Crazy Ones', N'Scripted', N'English', N'Comedy', N'Ended', 30, 30, N'2013-09-26', N'2014-04-17', N'', 0, 69, N'', N'<p><b>The Crazy Ones</b> is a comedy about a larger-than-life advertising genius whose unorthodox methods and unpredictable behavior would get him fired... if he weren''t the boss. Simon Roberts is the head of a powerful agency, with the biggest clients and brands in the world, but even more important to him is that his daughter Sydney is by his side. As his partner, Sydney is Simon''s exact opposite - focused, organized and eager to make a name for herself, but also too busy parenting her father, which she''d resent if he wasn''t so brilliant at what he does. Joining them in the firm are the dashing and talented Zach art director Andrew, who''s as hard-working as he is neurotic; and the beautiful and deceptively smart assistant Lauren. With his team and his daughter behind him, Simon continues to set the advertising world on fire, and it looks like they are definitely buying what these crazy ones are selling.</p>', 1600719036, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/3713.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/3713.jpg', N'', N'US', N'United States', N'CBS', N'', N'', N'', 7.1, N'Thursday', N'21:30', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (227, N'https://www.tvmaze.com/shows/227/mob-city', N'Mob City', N'Scripted', N'English', N'Drama, Crime', N'Ended', 60, 60, N'2013-12-04', N'2013-12-18', N'', 0, 84, N'', N'<p>The epic battle between a determined police chief and a dangerous mobster inflames 1940s Los Angeles in TNT''s eagerly anticipated television event <b>Mob City</b>. This powerful drama comes to TNT from Frank Darabont, who wrote and directed the pilot and serves as executive producer on the series. Based on the critically acclaimed book L.A. Noir: The Struggle for the Soul of America''s Most Seductive City, by John Buntin, Mob City opens in post-war Los Angeles, home to glamorous movie stars, powerful studio heads and returning war heroes. But it''s also a city caught between a powerful and corrupt police force and an even more dangerous criminal network determined to make L.A. its West Coast base. Los Angeles Police Chief William Parker has made it his mission to free the city of criminals like Ben "Bugsy" Siegel and Mickey Cohen, the ruthless king of the Los Angeles underworld. Parker also won''t hesitate to go after anyone from his own police force who sells out honor and duty for the sake of a big payout. To carry out his sweep of organized crime, Parker sets up a new mob task force within the LAPD. Headed by Det. Hal Morrison, the task force includes Det. Joe Teague, an ex-Marine who holds his cards close to his chest.</p>', 1580639981, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/117/293987.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/117/293987.jpg', N'', N'US', N'United States', N'TNT', N'', N'', N'', 7.4, N'Wednesday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (228, N'https://www.tvmaze.com/shows/228/last-resort', N'Last Resort', N'Scripted', N'English', N'Drama, Action, War', N'Ended', 60, 60, N'2012-09-27', N'2013-01-24', N'', 0, 72, N'', N'<p>500 feet beneath the ocean''s surface, the U.S. ballistic missile submarine Colorado receive their orders. Over a radio channel, designed only to be used if their homeland has been wiped out, they''re told to fire nuclear weapons at Pakistan. Captain Marcus Chaplin demands confirmation of the orders only to be unceremoniously relieved of duty by the White House. XO Sam Kendal finds himself suddenly in charge of the submarine and facing the same difficult decision. When he also refuses to fire without confirmation of the orders, the Colorado is targeted, fired upon, and hit. The submarine and its crew find themselves crippled on the ocean floor, declared rogue enemies of their own country. Now, with nowhere left to turn, Chaplin and Kendal take the sub on the run and bring the men and women of the Colorado to an exotic island. Here they will find refuge, romance and a chance at a new life, even as they try to clear their names and get home.</p>', 1578493975, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/3741.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/3741.jpg', N'', N'US', N'United States', N'ABC', N'', N'', N'', 7.2, N'Thursday', N'20:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (229, N'https://www.tvmaze.com/shows/229/the-neighbors', N'The Neighbors', N'Scripted', N'English', N'Comedy, Science-Fiction', N'Ended', 30, 30, N'2012-09-26', N'2014-04-11', N'http://abc.go.com/shows/the-neighbors', 0, 69, N'', N'<p><b>The Neighbors</b> revolves around a family that has relocated to a gated townhouse community in New Jersey called "Hidden Hills". Upon their arrival, they discover that the entire community is populated by residents from another planet. Amongst their myriad quirks, these aliens identify themselves by the names of sports celebrities, patrol the community in golf carts, dress alike, receive nourishment through their eyes and mind by reading books rather than eating, and cry green goo from their ears. The aliens have assumed human form, but they can revert to their natural appearance by clapping their hands above their heads. They have been stuck on Earth for 10 years, still awaiting instructions to return home.</p>', 1580639791, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/3763.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/3763.jpg', N'', N'US', N'United States', N'ABC', N'', N'', N'', 7, N'Friday', N'20:30', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (230, N'https://www.tvmaze.com/shows/230/go-on', N'Go On', N'Scripted', N'English', N'Comedy', N'Ended', 30, 30, N'2012-08-08', N'2013-04-11', N'', 0, 90, N'', N'<p>Following the sudden death of his wife, sports radio personality Ryan King is forced to attend grief counseling. Feeling it unnecessary, he does so reluctantly, and with minimal participation, until it becomes clear that this may actually help him in unexpected ways.</p>', 1637569035, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/3773.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/3773.jpg', N'', N'US', N'United States', N'NBC', N'', N'', N'', 7, N'Thursday', N'21:30', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (231, N'https://www.tvmaze.com/shows/231/vegas', N'Vegas', N'Scripted', N'English', N'Drama', N'Ended', 60, 60, N'2012-09-25', N'2013-05-10', N'', 0, 48, N'', N'<p><b>Vegas</b> is a drama inspired by the true story of former Las Vegas Sheriff Ralph Lamb, a fourth-generation rancher tasked with bringing order to Las Vegas in the 1960s, a gambling and entertainment mecca emerging from the tumbleweeds. Ralph Lamb wants to be left in peace to run his ranch, but Las Vegas is now swelling with outsiders and corruption which are intruding on his simple life. Recalling Lamb''s command as a military police officer during World War II, the Mayor appeals to his sense of duty to look into a murder of a casino worker - and so begins Lamb''s clash with Vincent Savino, a ruthless Chicago gangster who plans to make Vegas his own. Assisting Lamb in keeping law and order are his two deputies: his diplomatic, even-keeled brother Jack and his charming but impulsive son Dixon. Ambitious Assistant District Attorney Katherine O''Connell, who grew up on the ranch next to the Lambs, also lends a hand in preserving justice. In Vegas, two powerful men - Lamb and Savino - are engaged in a fierce battle for control of the budding oasis, and for both of them, folding is not an option.</p>', 1617726439, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/3781.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/3781.jpg', N'', N'US', N'United States', N'CBS', N'', N'', N'', 7.9, N'Friday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (232, N'https://www.tvmaze.com/shows/232/the-river', N'The River', N'Scripted', N'English', N'Drama, Horror, Supernatural', N'Ended', 60, 60, N'2012-02-07', N'2012-03-20', N'', 0, 72, N'', N'<p><b>The River</b> follows the story of wildlife expert and TV personality Emmet Cole. Emmet set course around the world with his wife, Tess, and son, Lincoln, while filming what would become one of the most popular shows in television. After he goes missing deep in the Amazon, his family, friends and crew set out on a mysterious and deadly journey to find him. Famed explorer Dr. Emmet Cole went looking for magic deep in the uncharted Amazon and never returned. The shocking truth about his disappearance is out there, somewhere, just waiting to be discovered. To the millions of kids who grew up watching his nature show, Dr. Cole was a hero. To his own son, Lincoln he was more of an enigma. Now, six months after he vanished, Lincoln is finally ready to bury the past when Dr. Cole''s emergency beacon suddenly goes off. At the urging of his mother, Tess Lincoln reluctantly joins her on a search for his father. To fund the rescue, they agree to let Dr. Cole''s cagey ex-producer, Clark film the mission documentary-style.</p>', 1617728752, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/3788.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/3788.jpg', N'', N'US', N'United States', N'ABC', N'', N'', N'', 6.7, N'Tuesday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (233, N'https://www.tvmaze.com/shows/233/awake', N'Awake', N'Scripted', N'English', N'Drama, Fantasy, Thriller', N'Ended', 60, 60, N'2012-03-01', N'2012-05-24', N'', 0, 90, N'', N'<p><b>Awake</b> is an intriguing drama about Detective Michael Britten who finds he''s living two parallel lives. He''s involved in a car accident that seems to have killed both his son and wife yet his mind creates an ingenious coping mechanism in which he now lives two separate lives - one where his wife survived and the other where his son did. Trying to regain some normalcy, Michael returns to solving crimes in both worlds with the help of two different partners, Detective Isaiah "Bird" Freeman and Detective Efrem Vega Michael is assigned a different case in each reality and quickly discovers that his dual existence is actually a powerful tool. He begins to solve impossible cases by using his two realities to gain unique perspectives and link clues that cross over from world to world. Helping Michael to navigate his two realities are his bureau-assigned therapists Dr. Evans and Dr. Lee While both therapists work to untangle his two worlds, Michael has no interest in proving either one is false. But when memories of the accident begin to haunt him, he is forced to confront the truth about what really happened the night of the crash.</p>', 1624813313, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/3799.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/3799.jpg', N'', N'US', N'United States', N'NBC', N'', N'', N'', 7.3, N'Thursday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (234, N'https://www.tvmaze.com/shows/234/missing', N'Missing', N'Scripted', N'English', N'Drama, Action, Thriller', N'Ended', 60, 60, N'2012-03-15', N'2012-05-17', N'', 0, 69, N'', N'<p>Becca Winstone learns that her son, Michael, disappears while studying abroad, and it''s a race against time when she travels to Europe to track him down. A surprising turn of events reveals just how far one mother will go to protect her family. Exotic locations and thrilling twists will keep you riveted in <b>Missing</b>. How far would you go to save the only thing you have left in the world? At 8 years old, Michael watched as his father, CIA Agent Paul Winstone, was murdered. Now 10 years later, Paul''s wife, Becca, is faced with the reality of her son growing up. When Michael is afforded the opportunity to study abroad, his mother reluctantly agrees it''s time to let him go. Just a few weeks into his trip Michael disappears, and Becca immediately suspects foul play. When she arrives in Rome, she begins piecing together the clues left behind. It isn''t long before the kidnappers realize they''ve picked a fight with the wrong woman. Becca Winstone has a secret of her own -- before Paul''s death, she was also a lethal CIA Agent. But if she wants to find her son alive, Becca will have to rely on old friends and reopen old wounds. Her resourcefulness, skill and determination will be put to the test - but a mother''s love knows no limits.</p>', 1575110923, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/3808.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/3808.jpg', N'', N'US', N'United States', N'ABC', N'', N'', N'', 6.8, N'Thursday', N'20:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (235, N'https://www.tvmaze.com/shows/235/the-new-normal', N'The New Normal', N'Scripted', N'English', N'Comedy', N'Ended', 30, 30, N'2012-09-10', N'2013-04-02', N'', 0, 48, N'', N'<p>These days, families come in all forms - single dads, double moms, sperm donors, egg donors, one-night-stand donors. Bryan and David are a Los Angeles couple and they have it all. Well, almost. With successful careers and a committed, loving partnership, there is one thing that this couple is missing: a baby. Just when they think the stars will never align, enter Goldie an extraordinary young woman with a checkered past. A midwestern waitress and single mother looking to escape her dead-end life and small-minded grandmother Goldie decides to change everything and move out west with her precocious eight year-old daughter. Desperate and broke - but also fertile - Goldie quickly becomes the guys'' surrogate and quite possibly the girl of their dreams. Surrogate mother, surrogate family.</p>', 1617730037, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/3817.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/3817.jpg', N'', N'US', N'United States', N'NBC', N'', N'', N'', 7.3, N'Tuesday', N'21:30', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (236, N'https://www.tvmaze.com/shows/236/gcb', N'GCB', N'Scripted', N'English', N'Drama, Comedy, Romance', N'Ended', 60, 60, N'2012-03-04', N'2012-05-06', N'http://abc.go.com/shows/gcb', 0, 70, N'', N'<p>Amanda Vaughn once the ultimate high school "mean girl", is forced to return home in disgrace after her marriage ends in scandal. Amanda is nothing like the girl she was 20 years ago, but as her old classmates reacquaint themselves with the new Amanda, will her home town welcome her with open arms or seek revenge? No one in this town is a saint, but that doesn''t mean they can''t have a heart. As Amanda and her teenage kids try to adjust to their new lives, the ladies from her past alternate between sympathy and scheming.</p>', 1573226209, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/84/212122.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/84/212122.jpg', N'', N'US', N'United States', N'ABC', N'', N'', N'', 7.1, N'Sunday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (237, N'https://www.tvmaze.com/shows/237/revolution', N'Revolution', N'Scripted', N'English', N'Action, Adventure, Science-Fiction', N'Ended', 60, 60, N'2012-09-17', N'2014-05-21', N'', 0, 94, N'', N'<p>What would you do without it all? In this epic adventure, a family struggles to reunite in an American landscape void of electricity: a world of empty cities, local militias and heroic freedom fighters, where every single piece of technology -- computers, planes, cars, phones, even lights -- has mysteriously blacked out forever.</p>', 1602428735, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/55/138043.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/55/138043.jpg', N'', N'US', N'United States', N'NBC', N'', N'', N'', 7.6, N'Wednesday', N'20:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (238, N'https://www.tvmaze.com/shows/238/dallas', N'Dallas', N'Scripted', N'English', N'Drama, Family', N'Ended', 60, 60, N'2012-06-13', N'2014-09-22', N'', 0, 48, N'', N'<p><b>Dallas</b> follows Bobby Ewing, now the senior member of the Ewing family following the death of his older brother J.R. Ewing. Following the death of his revered father, John Ross is out to prove he can be just as powerful an ally or enemy as his infamous father. Bobby''s adopted son Christopher is newly single and determined to make a name for himself and his family in the world of natural gas. Elena Ramos is the former girlfriend of both John Ross and Christopher who is now blinded by thoughts of justice for previous wrongs. Pamela Rebecca Barnes is John Ross'' wife and the daughter of Cliff Barnes, a longtime rival of the Ewings. She is determined to have a happy ending with her husband and make a home on Southfork Ranch. Also featured is Bobby''s wife Ann and Harris Ryland, her scheming ex-husband. Emma Ryland is Ann and Harris'' daughter, who has been taught by her father and grandmother.</p>', 1632241700, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/3848.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/3848.jpg', N'', N'US', N'United States', N'TNT', N'', N'', N'', 6.2, N'Monday', N'21:00', 0, N'', N'', N'')
