INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (240, N'https://www.tvmaze.com/shows/240/cops', N'Cops', N'Reality', N'English', N'Action, Crime', N'Running', 30, 30, N'1989-03-11', N'', N'http://www.cops.com', 0, 97, N'', N'<p><b>COPS</b> follows police officers, constables, and sheriff''s deputies during patrols and various police activities by embedding camera crews with their units. The show''s formula adheres to a classic <i>cinéma vérité</i> ethos. With no narration or scripted dialog, it depends entirely on the commentary of the officers and on the actions of the people with whom they come into contact.</p>', 1638481748, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/4185.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/4185.jpg', N'', N'US', N'United States', N'Paramount Network', N'', N'', N'', 7.9, N'Friday', N'', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (241, N'https://www.tvmaze.com/shows/241/benched', N'Benched', N'Scripted', N'English', N'Comedy, Legal', N'Ended', 30, 30, N'2014-10-28', N'2014-12-30', N'http://www.usanetwork.com/benched', 0, 48, N'', N'<p><b>Benched</b> is a single-camera comedy about a high-powered corporate lawyer''s fall from grace into the rough-and-tumble world of the public defenders. From ABC Signature Studio, it stars Coupe as Nina Whitley, a distinguished corporate lawyer who has given up everything in her climb to the top. However, when she''s hit with her ex-fiancé''s engagement announcement and learns that she hasn''t made partner at her high power firm, Nina snaps -- breaking vases and burning bridges.</p><p>Now that Nina is shunned from the corporate world, the only place she can get a job is at the Public Defender''s office: home to the underfunded, understaffed, overworked, "if you can''t afford a lawyer, one will be provided... " lawyers. In addition to her new clients, Nina must learn to connect with her co-workers, including the roguish Phil, the idealistic Carlos, the useless empathetic Cheryl and the dedicated intern Micah. If that didn''t sound tough enough for Nina, she''ll also be going head-to-head with her ex-fiancé, Trent, the rising star of the District Attorney''s office.</p>', 1617733468, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/4351.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/4351.jpg', N'', N'US', N'United States', N'USA Network', N'', N'', N'', 6.7, N'Tuesday', N'22:30', 0, N'', N'', N'')
