INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (244, N'https://www.tvmaze.com/shows/244/strange-empire', N'Strange Empire', N'Scripted', N'English', N'Drama, Western', N'Ended', 60, 60, N'2014-10-06', N'2015-02-02', N'http://www.cbc.ca/strangeempire/', 0, 48, N'', N'<p><b>Strange Empire</b> is a Western whose heroes are women. With most of their men gone, and those who remain battling for control, the women struggle to survive, to find their independence, and to build a life in which to thrive and raise families. As the stories of Janestown''s citizens unfold we see the clash between a power-hungry father and son and the deep prejudices among races, but also the start of something akin to community in this Wild West. Western stories take civilization as a goal; they begin in blood, and end in the morality of Main Street.</p>', 1597052532, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/4585.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/4585.jpg', N'', N'CA', N'Canada', N'CBC', N'', N'', N'', 7.2, N'Monday', N'21:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (245, N'https://www.tvmaze.com/shows/245/town-of-the-living-dead', N'Town of the Living Dead', N'Reality', N'English', N'', N'Ended', 30, 30, N'2014-10-07', N'2014-11-11', N'', 0, 43, N'', N'<p>In <b>Town of the Living Dead</b>, the colorful folks of Jasper, Alabama are determined, once and for all, to complete their zombie movie, Thr33 Days Dead... now six long years in the making. Based on a town urban legend, their film centers on a group of friends trying to survive a zombie apocalypse in rural Alabama. The series will follow the intrepid and motley crew of amateur filmmakers as they struggle against every obstacle imaginable to get to a final cut of their film... which could someday become a Syfy movie.</p>', 1617743426, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/4590.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/4590.jpg', N'', N'US', N'United States', N'Syfy', N'', N'', N'', 0, N'Tuesday', N'22:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (246, N'https://www.tvmaze.com/shows/246/long-shadow', N'Long Shadow', N'Documentary', N'English', N'War, History', N'Ended', 60, 60, N'2014-09-24', N'2014-10-08', N'http://www.bbc.co.uk/programmes/b04jqxtl', 0, 30, N'', N'<p>David Reynolds traces the legacy of the Great War across 100 years and 10 different countries, examining how the war haunted a generation and shaped the peace that followed.</p>', 1578901625, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/4591.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/4591.jpg', N'', N'GB', N'United Kingdom', N'BBC Two', N'', N'', N'', 0, N'Wednesday', N'20:00', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (247, N'https://www.tvmaze.com/shows/247/the-colbert-report', N'The Colbert Report', N'Talk Show', N'English', N'Comedy', N'Ended', 30, 30, N'2005-10-17', N'2014-12-18', N'', 0, 46, N'', N'<p>Feel the news along with Stephen Colbert, America''s ballsiest pundit.</p>', 1627227536, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/326/817399.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/326/817399.jpg', N'', N'US', N'United States', N'Comedy Central', N'', N'', N'', 7.5, N'Monday, Tuesday, Wednesday, Thursday', N'23:30', 0, N'', N'', N'')
INSERT [dbo].[TvShow] ([Id], [Url], [Name], [Type], [Language], [Genres], [Status], [Runtime], [AverageRuntime], [Premiered], [Ended], [OfficialSite], [TheTvDb], [Weight], [DvdCountry], [Summary], [Updated], [Href], [ImageMedium], [ImageOriginal], [Imdb], [NetworkCountryCode], [NetworkCountryName], [NetworkName], [NetworkOfficialSite], [NextEpisodeHref], [PreviousEpisodeHref], [RatingAverage], [ScheduleDays], [ScheduleTime], [TvRage], [WebChannelCountryCode], [WebChannelCountryName], [WebChannelName]) VALUES (248, N'https://www.tvmaze.com/shows/248/transporter-the-series', N'Transporter: The Series', N'Scripted', N'English', N'Action, Adventure, Crime', N'Ended', 60, 60, N'2013-01-04', N'2014-12-14', N'', 0, 90, N'', N'<p>Frank Martin returns as the Transporter with one very simple task - to deliver the package against all the odds. However, something that sounds so simple, is rarely so.</p><p>Joined by two new team members, Caterina Boldieu, an ex- DGSE agent and later in the series, Jules Faroux, a computer and mechanical whizz, Frank is hired to deliver a diverse range of packages - from pop princesses to priceless paintings.</p><p>Frank Martin takes the jobs no other transporter will touch or can achieve - simply because they are too challenging and the odds seemingly insurmountable. That is why he is considered the best transporter in the world.</p><p>Frank''s jobs take him to many beautiful locations around the world, but they also draw him into danger and mystery. And more often than not, solving that mystery will lead Frank to successfully completing his mission.</p><p>However Frank''s jobs aren''t solely about the packages he must deliver but also about the people he meets. While his emphasis is always on completing the mission, Frank is unable to avoid the human emotions that come with dealing with clients in difficult situations - no matter how hard he tries.</p>', 1641350402, N'', N'https://static.tvmaze.com/uploads/images/medium_portrait/1/4593.jpg', N'https://static.tvmaze.com/uploads/images/original_untouched/1/4593.jpg', N'', N'DE', N'Germany', N'RTL', N'', N'', N'', 7.2, N'Sunday', N'21:00', 0, N'', N'', N'')
